(1, 'CAREER0001', 2, 'Social Digital Marketing', 'Pemasaran Digital Sosial', 'DIW.co.id Website Service Company requires: <br>\r\nMarketing <br>\r\n<br>\r\n\"Marketing job is the best job of all jobs because marketing is the company\'s milestone because without marketing, the company will not grow.\" <br>\r\n<br>\r\nTerms and Conditions: <br>\r\n1. Women <br>\r\n2. Age 17-25 years <br>\r\n3. Minimum education SMA / SMK <br>\r\n4. Honest, tenacious, outgoing, attractive <br>\r\n5. Responsible for achieving personal sales <br>\r\n6. High creativity in the marketing world <br>\r\n7. Have polite language in handling call centers <br>\r\n8. Have a high soliality spirit <br>\r\n9. Understand social media well <br>\r\n10. Having a good relationship with the community <br>\r\n11. Look attractive and polite <br>\r\n12. Good at negotiating with clients <br>\r\n<br>\r\nPreferred: <br>\r\n1. Be active on social media <br>\r\n2. Currently studying and not taking a thesis <br>\r\n3. Have a personal laptop <br>\r\n<br>\r\nWork / Responsibilities <br>\r\n1. Handling Social Media DIW.co.id -\r\n2. Serving clients well <br>\r\n3. Creativity in content marketing <br>\r\n4. Increase the reach of social media <br>\r\n5. Selling services at diw.co.id <br>\r\n6. Introducing the company at diw.co.id <br>\r\n7. SPK Sale and Purchase Document Archives\r\n<br>\r\nNote: <br>\r\n1. Working Hours 09:00 - 18.00 <br>\r\n2. 3 Month Contract <br>\r\n3. Placement at DIW.co.id Office\r\n<br>\r\nYou are attracted? <br>\r\nSend Application + Passport Photo + Photocopy of KTP + CV to email hrd@diw.co.id <br>\r\n<br>\r\nThank you', 'DIW.co.id Perusahaan Jasa Website membutuhkan :<br>\r\nMarketing<br>\r\n<br>\r\n\"Pekerjaan marketing adalah pekerjaan paling terbaik dari semua pekerjaan karena marketing adalah batu tonggak perusahaan karena tanpa marketing, perusahaan tidak akan berkembang.\"<br>\r\n<br>\r\nSyarat dan Ketentuan :<br>\r\n1. Wanita<br>\r\n2. Umur 17 - 25 Tahun<br>\r\n3. Pendidikan Minimal SMA/SMK<br>\r\n4. Jujur, Ulet, Supel, Menarik<br>\r\n5. Bertanggung jawab atas pencapaian penjualan pribadi<br>\r\n6. Berkreativitas tinggi pada dunia marketing<br>\r\n7. Mempunyai bahasa santun dalam menangani call center<br>\r\n8. Memiliki jiwa solialitas tinggi<br>\r\n9. Mengerti tentang social media dengan baik<br>\r\n10. Memiliki hubungan yang baik dengan masyarakat<br>\r\n11. Berpenampilan menarik dan sopan<br>\r\n12. Pandai bernegosiasi dengan client<br>\r\n<br>\r\nDiutamakan :<br>\r\n1. Aktif di sosial media<br>\r\n2. Sedang Kuliah dan tidak mengambil skripsi<br>\r\n3. Memiliki laptop pribadi<br>\r\n<br>\r\nPekerjaan / Tanggung Jawab<br>\r\n1. Menangani Sosial Media DIW.co.id<br>\r\n2. Melayani Client dengan baik<br>\r\n3. Kreativitas dalam hal pembuatan konten marketing<br>\r\n4. Menaikan jangkauan social media<br>\r\n5. Menjual jasa diw.co.id<br>\r\n6. Memperkenalkan perusahaan diw.co.id<br>\r\n7. Arsip Dokumen SPK Jual Beli<br>\r\n<br>\r\nCatatan :<br>\r\n1. Jam Kerja 09:00 - 18.00<br>\r\n2. Kontrak 3 Bulan<br>\r\n3. Penempatan di Kantor DIW.co.id<br>\r\n<br>\r\nAnda tetarik ?<br>\r\nKirimkan Lamaran + Pas Foto + Fotocopy KTP + CV ke email hrd@diw.co.id<br>\r\n<br>\r\nTerima Kasih', 'Office DIW.co.id - North Serpong | 75 Jelupang Raya Street, Jelupang, North Serpong, South Tangerang City, Banten, Indonesia - 15323', 'Kantor DIW.co.id - Serpong Utara | Jalan Jelupang Raya No.75, Jelupang, Serpong Utara, Kota Tangerang Selatan, Banten, Indonesia - 15323', 'Marketing', 'Pemasaran', '2017-08-08 00:00:00', 1, NULL, NULL, NULL, '2017-08-06 20:00:00', '2019-07-27 08:45:55', NULL),
