(14, 'CHARGE180125001', 83, 84, 172, 100000, '', '2018-01-25 20:15:22', '1. ADD ITEM IN : Location To langsung di lock Gudang DC jadi jangan bisa milih tempat lain, trus kolom item dibuat bisa menambahkan banyak barang dan quantity nya ikut banyak juga. Contoh kasus jika dalam 1 pengiriman barang masuk ada 10 item masa harus di input nya satu satu harusnya di bikin lebih efisien. Jadi sekali  add item in bisa tambah barang masuk sampai 10 item dan quantity nya ada 10 kolom.\r\n\r\n2. ADD ITEM OUT : Location From langsung di lock Gudang DC jadi jangan bisa milih tempat lain, trus kolom item dibuat bisa menambahkan banyak barang dan quantity nya ikut banyak juga. Contoh kasus jika dalam 1 pengiriman barang masuk ada 10 item masa harus di input nya satu satu harusnya di bikin lebih efisien. Jadi sekali  add item in bisa tambah barang masuk sampai 10 item dan quantity nya ada 10 kolom.\r\n\r\n3. alert di Item tersebut jika stock sudah mau habis sisa quantity 50 atau ada tambahan informasi di dashbard jika barang tersebut sudah kurang dari 50 qty. Dan tidak bisa barang di stock minus ( ini seharusnya sudah ada di revisi I)\r\n\r\n4. Sistem report item in dan report item out ( juga seharusnya sudah ada di revisi I)\r\nNB: Pastikan tercatat di LOG dan Report item in & Report item out.\r\nTerima Kasih.', 1, NULL, NULL, NULL, '2018-01-24 16:15:22', '2021-03-17 05:25:51', NULL),
(15, 'CHARGE180129001', 59, 60, 176, 400000, '', '2018-01-29 10:40:00', '1. Lowongan Pekerjaan tidak bisa dihapus\r\n2. Ada status Lowongan Pekerjaan yaitu aktif dan tidak aktif, Perusahaan dapat melihat Lowongan Pekerjaan tetapi pekerja dan user tidak dapat dan terdapat tulisan Lowongan Pekerjaan ini sudah ditutup. Perusahaan dapat mengubah status Lowongan Pekerjaan tersebut.\r\n3. Pekerja dapat melihat status apply dia sudah direviewed. Perusahaan mengubah status apply pekerja yang telah apply menjadi Reviewed atau not reviewed yet', 1, NULL, NULL, NULL, '2018-01-28 06:40:00', '2021-03-17 05:26:54', NULL),
