(3, NULL, 'Syuting Kaskus Ads', 'Syuting KASKUS ADS bareng teman2 kaskus.\n\nSeru dan semangat dalam proses syuting.\n\nJawaban Wawancara Kaskus ADS\nHai, nama saya Andri Sunardi, tinggal daerah Tangerang. Usaha yang saya rintis adalah usaha jasa pembuatan website yang dapat disesuaikan oleh permintaan client yang bernama DIW.co.id yang sudah dijalankan selama 2 tahun dari oktober 2015\n\nSaya mempromosikan usaha saya ini menggunakan kaskus FJB yang sudah bergabung dari tahun 2011 dan memberitahukan lewat social media seperti facebook, instagram, dan sebagainya. Potensi Kaskus FJB itu sangat tinggi dan bermanfaat bagi usaha saya.\n\nSaya mengetahui KASKUS ADS itu dari website kaskus, dimana KASKUS memberitahukan bahwa ada KASKUS ADS.\n\nKASKUS ADS sangat bermanfaat bagi usaha saya. \nBanyak yang melirik usaha jasa saya dan mengunjungi website diw.co.id\nMulanya saya melihat visitor website hanya 10 sampai 20 per hari, tetapi dengan menggunakan KASKUS ADS, visitor unik saya bertambah menjadi 100 sampai 200 per hari\n\nAlasan saya terus menggunakan KASKUS ADS karena KASKUS adalah media marketplace yang terpecaya dan terbesar di indonesia dan sudah dikenal di internasional. KASKUS ADS juga memberikan kemudahan dalam beriklan seperti pembayaran yang beragam dan harga yang terjangkau bagi startup yang memulai usahanya.\n\nSaya sangat merekomendasikan ke teman dan partner saya untuk menggunakan KASKUS ADS sebagai media iklan yang terbaik dan terluas di seluruh dunia.', 'Kaskus Office\nMenara Palma Annex Building P11, Jl. H. R. Rasuna Said Blok X2 Kav 6, Kuningan, Kuningan Timur, RT.8/RW.4, RT.10/RW.4, Kuningan Tim., Setia Budi, Kota Jakarta Selatan, Daerah Khusus Ibukota Jakarta', '', '', '2017-11-07 11:28:20', 1, NULL, NULL, NULL, '2017-11-06 07:28:20', '2019-07-27 09:09:24', NULL),
(4, NULL, 'Rising Young Entrepreuner - Speaker Bong Chandra', '\"Pak Bong, apakah startup yang sudah jalan perlu membutuhkan Investor? Apakah Angel Investor perlu kita cari? Bagaimana tipsnya pak?\n\nJawab:\n\"Jika startup yang sudah kita mulai dan sudah bertumbuh, tidak perlu lagi Investor. Karena Investor itu diperlukan untuk startup yang sangat fresh atau baru\n\nAt @gbiwtcserpong \nSpeaker @bongchandra \nOctober 21, 2017', 'GBI WTC Serpong\nRuko Golden Boulevard Blok W1 No. 29, Jl. Pahlawan Seribu, Lengkong Karya, Serpong Utara, Lengkong Karya, Serpong Utara, Kota Tangerang Selatan, Banten 15310', '', '', '2017-10-21 09:30:00', 1, NULL, NULL, NULL, '2017-10-20 05:30:00', '2019-07-27 09:09:24', NULL);
