(1, 'Can DIW.co.id work on a thesis program?', 'Apakah DIW.co.id bisa mengerjakan program skripsi ?', 'Can. We offer help to work on your thesis program majoring in IT / SI website-based.', 'Bisa. Kami menawarkan bantuan untuk mengerjakan program skripsi anda jurusan IT/SI berbasis website.', 1, NULL, NULL, NULL, '2020-11-16 08:21:55', '2020-11-16 08:21:55', NULL),
(2, 'Can DIW.co.id work on a thesis other than IT / SI major?', 'Apakah DIW.co.id bisa mengerjakan skripsi selain jurusan IT/SI ?', 'Sorry, we can\'t do it at this time. We only provide web-based thesis programming services.', 'Mohon maaf untuk saat ini belum bisa. Kami hanya melayani jasa pembuatan program skripsi berbasis web.', 1, NULL, NULL, NULL, '2020-11-16 08:21:56', '2020-11-16 08:21:56', NULL),
(3, 'Can DIW.co.id only work on the paper without a program?', 'Apakah DIW.co.id bisa mengerjakan hanya papernya saja tanpa program ?', 'Sorry, we can\'t do it at this time. We only work on website based programs. Cannot serve thesis paper yet.', 'Mohon maaf untuk saat ini belum bisa. Kami hanya mengerjakan program berbasis website. Belum bisa melayani paper skripsi.', 1, NULL, NULL, NULL, '2020-11-16 08:21:57', '2020-11-16 08:21:57', NULL);
