INSERT INTO `histories` (`id`, `name`, `name_idn`, `description`, `description_idn`, `is_active`, `created_by_id`, `updated_by_id`, `deleted_by_id`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, '2013', '2013', 'The first thing before opening a business DIW.co.id, Andri Sunardi learn PHP Native programming language and MySQL Database for 2 years on the website aflashgame.com. At Aflashgame.com, Andri Sunardi created a website that can be played by adobe-based flash community. Aflashgame, owned by William Tansil, grants access to his website to Andri Sunardi to learn more about the website.', 'Hal pertama sebelum membuka bisnis DIW.co.id, Andri Sunardi belajar bahasa pemrograman asli PHP dan Database MySQL selama 2 tahun di situs aflashgame.com. Di Aflashgame.com, Andri Sunardi membuat situs web yang dapat dimainkan oleh komunitas flash berbasis adobe. Aflashgame, yang dimiliki oleh William Tansil, memberikan akses ke situs webnya kepada Andri Sunardi untuk mempelajari lebih lanjut tentang situs web tersebut.', 1, NULL, NULL, NULL, '2020-11-12 10:14:13', '2020-11-12 10:14:13', NULL),
(2, '2015', '2015', 'Digital In Website named by Andri Sunardi which means to create an inspiring website to the public with an interesting and inspiring look. On October 23, 2015, an Andri Sunardi friend named Erwin Panji Laksono, created the first Develop Inspire Website logo design and used it to date. Then Andri Sunardi published the website Develop Inspire Website with domain www.developinspirewebsite.com on October 27, 2015 which aims to display the portfolio that has been done.', 'Develop Inspire Website yang diberi nama oleh Andri Sunardi yang berarti membuat situs web yang menginspirasi kepada publik dengan tampilan yang menarik dan inspiratif. Pada 23 Oktober 2015, seorang teman Andri Sunardi bernama Erwin Panji Laksono, menciptakan desain logo Menginspirasi Inspire Website pertama dan menggunakannya hingga saat ini. Kemudian Andri Sunardi menerbitkan website Mengembangkan Inspire Website dengan domain www.developinspirewebsite.com pada 27 Oktober 2015 yang bertujuan untuk menampilkan portofolio yang telah dilakukan.', 1, NULL, NULL, NULL, '2020-11-12 10:14:13', '2020-11-12 10:14:13', NULL),
(3, '2017', '2017', 'At this time in 2017, DIW.co.id has been working on 68 project websites from 2015. Website categories are made very varied, ranging from thesis program, company profile, e-commerce, personal, and much more. The process is very fast, about 1 month depending on the concept that the client provide. We also provide a very affordable cost to our clients and our clients are very satisfied with our services DIW.co.id. We will continue to be creative and innovative to the current website trend to advance our business DIW.co.id and generate many projects and client satisfaction.<br><br>Our website that almost 2 years ago from 2015, now turned into a version 2.0 that is more fresh and more simple than the website diw.co.id the old or the first time. By listening to criticism and suggestions from our clients and friends, we changed some of the functions and added features on our website. Our domain has also changed from www.developinspirewebsite.com to www.diw.co.id on 07 June 2017. The website that has been established by Andri Sunardi as Freelancer, is now a Professional Website Services Company that will continue to grow in the future.<br><br>With the establishment of DIW.co.id v.2.0 website, then we plan to put DIW.co.id to an Office addressed on Jl. Jelupang Raya No.75, Jelupang, North Serpong, South Tangerang City, Banten 15323. The first DIW.co.id office is still not perfect and will keep the DIW.co.id Office more comfortable for employees, clients, And who wants to come to our office. Our struggle has not been completed yet, and we will continue to plan ahead of time for DIW.co.id to be more in demand by the public.', 'Pada saat ini di tahun 2017, DIW.co.id telah mengerjakan 68 situs web proyek dari 2015. Kategori situs web dibuat sangat bervariasi, mulai dari program tesis, profil perusahaan, e-commerce, pribadi, dan banyak lagi. Prosesnya sangat cepat, sekitar 1 bulan tergantung pada konsep yang klien berikan. Kami juga memberikan biaya yang sangat terjangkau kepada klien kami dan klien kami sangat puas dengan layanan kami DIW.co.id. Kami akan terus kreatif dan inovatif dengan tren situs web saat ini untuk memajukan bisnis kami DIW.co.id dan menghasilkan banyak proyek dan kepuasan klien.<br><br>Website kami yang hampir 2 tahun lalu dari tahun 2015, kini berubah menjadi versi 2.0 yang lebih segar dan lebih sederhana dari situs web yang diw.co.id yang lama atau baru pertama kali. Dengan mendengarkan kritik dan saran dari klien dan teman kami, kami mengubah beberapa fungsi dan fitur tambahan di situs web kami. Domain kami juga telah berubah dari www.developinspirewebsite.com menjadi www.diw.co.id pada tanggal 07 Juni 2017. Situs web yang telah ditetapkan oleh Andri Sunardi sebagai Freelancer, sekarang menjadi Perusahaan Layanan Situs Web Profesional yang akan terus berkembang di masa depan.<br><br>Dengan pendirian situs web DIW.co.id v.2.0, maka kami berencana untuk menempatkan DIW.co.id ke Kantor yang beralamatkan di Jl. Jelupang Raya No.75, Jelupang, Serpong Utara, Kota Tangerang Selatan, Banten 15323. Kantor DIW.co.id yang pertama masih belum sempurna dan akan membuat Kantor DIW.co.id lebih nyaman bagi karyawan, klien, dan yang menginginkan untuk datang ke kantor kami. Perjuangan kami belum selesai, dan kami akan terus merencanakan sebelumnya untuk DIW.co.id agar lebih diminati oleh publik.', 1, NULL, NULL, NULL, '2020-11-12 10:14:13', '2020-11-12 10:14:13', NULL),
(4, '2018', '2018', 'Because too many websites have different structures, DIW.co.id decided to create a website structure and framework that can be used on several website projects. So if there is a update, then all website projects can be updated automatically. And DIW.co.id develops a CMS (Content Management System) where clients can process data in the CMS without the need to wait for DIW.co.id to process it and it will be completed in 2019.', 'Karena terlalu banyak website yang strukturnya berbeda, maka DIW.co.id memutuskan untuk membuat struktur dan kerangka website yang dapat dipakai di beberapa project website. Sehingga jika terdapat pembaharuan, maka seluruh project website dapat diperbaharui secara otomatis. Dan DIW.co.id mengembangkan CMS (Content Management System) dimana client bisa mengolah data di CMS tersebut tanpa perlu menunggu DIW.co.id untuk mengolahnya dan akan selesai di tahun 2019.', 1, NULL, NULL, NULL, '2020-11-12 10:14:13', '2020-11-12 10:14:13', NULL),
(5, '2019', '2019', 'On Progress', 'On Progress', 1, NULL, NULL, NULL, '2020-11-12 10:14:13', '2020-11-12 10:14:13', NULL),
(6, '2020', '2020', 'On Progress', 'On Progress', 1, NULL, NULL, NULL, '2020-11-12 10:14:13', '2020-11-12 10:14:13', NULL);
