(1, 'NEWS17111101', 1, 'DIW News November 11, 2017', NULL, NULL, NULL, 'DIW News November 11, 2017\n\nDengan beta version DIW System saat ini sedang berlangsung\nMaka seluruh Project Website yang telah selesai dikerjakan sebelum bulan November 2017\nDinyatakan Sudah selesai dan tidak dapat direvisi lagi (Kecuali terdapat surat kontrak yang dibuat)\n\nJika terdapat revisi/perubahan/maintenance, maka akan dikenakan biaya charge per revisi dan yang telah disetujui oleh pihak developer kami.\n\nKedepannya, DIW.co.id akan menggunakan DIW System (Online) dan surat perjanjian kerjasama (Offline) baik itu di mahasiswa/individual maupun pada perusahaan.\n\nDengan adanya DIW System Beta Version ini, pengguna dapat lebih mudah dan jelas membeli jasa pembuatan website kami.\nSemuanya akan terintegrasi dengan sistem dan tidak lagi dengan manual.\n\nDIW Feature System\n1. Payment\n2. Progress Website\n3. Revision\n4. Web Setting\n5. My Orders\n6. My Website\n7. Affiliate\n8. Sponsorship\n9. Masih banyak lagi\n\nKunjungi website diw.co.id untuk lebih lanjut\n\nDIW System akan dirilis January 2018\n\nThank You', NULL, '', NULL, NULL, NULL, 'diw-news-november-11-2017', 0, NULL, NULL, NULL, '2017-11-09 20:00:00', '2019-07-27 14:02:59', NULL),
