(6, 'NEWS18102801', 1, 'Happy Birthday 3rd DIW.co.id', NULL, NULL, NULL, 'Selamat Ulang Tahun DIW.co.id yang ke 3.\nTidak terasa sudah 3 tahun menemani kalian untuk membuat website yang kalian inginkan.\n\nTerima kasih kepada sahabat dan partner bisnis yang selalu mendukung dan mempercayakan kepada jasa kami.\nKami meminta maaf jika terdapat kesalahan baik dari dari perkataan dan perbuatan yang kami tidak sengaja.\n\nJangan lupa terus pakai jasa kami.\nKarena DIW.co.id akan terus berinovasi terhadap sistem website yang lagi trending.\n\nHormat kami\n\n\nAndri Sunardi', NULL, 'news18102801.jpg', NULL, NULL, NULL, 'happy-birthday-3rd-diw-co-id', 0, NULL, NULL, NULL, '2018-10-26 20:00:00', '2019-07-27 14:02:59', NULL),
(7, 'NEWS18110201', 1, 'DIW.co.id by Ceksite.com', NULL, NULL, NULL, 'Berapakah harga estimasi situs diw.co.id ?\n\ndiw.co.id\nMempunyai harga estimasi senilai\n\nRp 20.335.230\n\nHarga website dihitung pada: 2 November 2018 20:32:27\n\nLink : http://ceksite.com/id/cost/diw.co.id\n\nCopyright 2015 - 2018 ® DIW.co.id (Develop Inspire Website) ™. All Rights Reserved.\n\n#diw #diw_co_id #developinspirewebsite #web #site #situsweb #website #createweb #createwebsite #jasaweb #jasawebsite #buatweb #buatweb #buatwebsite #startup #aplikasi #application #program #company #companyprofile #ecommerce #toko #online #internet #service #webdesign #design #programming #skripsi #thesis', NULL, 'news18110201.jpg', NULL, NULL, NULL, 'diw-co-id-by-ceksite-com', 0, NULL, NULL, NULL, '2018-10-31 20:00:00', '2019-07-27 14:02:59', NULL),
(8, 'NEWS18122401', 1, 'Christmas Eve 2018', NULL, NULL, NULL, 'Saya Andri Sunardi, mengucapkan, Selamat Ibadah Malam Natal 2017 .\n\nMerry christmas, All of You.\nThe peace of Christ surrounds us.\nExperience the beautiful Christmas Eve\n\nKebahagiaan berada pada Kristus dan kita percaya kepadanya.\nKarena Kasih Kristus mendamaikan hati kita semua.\nJesus Bless You', NULL, 'news18122401.jpg', NULL, NULL, NULL, 'christmas-eve-2018', 0, NULL, NULL, NULL, '2018-11-22 20:00:00', '2019-07-27 14:02:59', NULL),
(9, 'NEWS18122501', 1, 'Merry Christmas 2018', NULL, NULL, NULL, 'Damai Kristus Yesus melingkupi kita, rasakan malam natal yang indah.\n.\nHadiah yang terbaik bukanlah hadiah yang paling mahal.\nHadiah yang terindah bukanlah yang ada di pohon natal.\nHadiah yang terindah dan terbagus adalah Natal itu sendiri, kelahiran Tuhan.\n.\nDamai di Bumi, Damai di Hati. Biarlah Damai dan Kasih Kristus serta Sukacita Natal menyertai hari hari kita.\nSelamat Natal.\n.\nChristmas Eve\nMerry Christmas 2018\nHappy New Year 2019\n.\nYesaya 9 : 6 \"Sebab seorang anak telah lahir untuk kita, seorang putera telah diberikan untuk kita; lambang pemerintahan ada di atas bahunya, dan namanya disebutkan orang: Penasihat Ajaib, Allah yang Perkasa, Bapa yang Kekal, Raja Damai.\" .\n.\nDIW.co.id Teams\n.\n#gereja #ibadah #church #kristen #natal #christmas #christmastree #christmaseve #christ #christmasday #trending #photography #photo #winter #beauty #life #lifestyle #instagram #instagramers #instagood #photooftheday #yesus #kristus #happy #cute #pictureoftheday #picture #ootd #love #amazing', NULL, 'news18122501.jpg', NULL, NULL, NULL, 'merry-christmas-2018', 0, NULL, NULL, NULL, '2018-11-23 20:00:00', '2019-07-27 14:02:59', NULL),
(10, 'NEWS18123101', 1, 'Happy New Year 2019', NULL, NULL, NULL, 'Besok adalah lembar kosong pertama dari 365 halaman. Pastikan kamu melakukan hal-hal yang baik dan mari perbaiki kesalahan yang sudah dilakukan agar menjadi pribadi yang lebih baik lagi.\n\nHari berganti bulan berganti\nTahun pun berganti\nTahun baru harapan baru\nSemangat baru\nSelamat Tahun Baru 2019\nSelamat berkarya di 2019', NULL, 'news18123101.jpg', NULL, NULL, NULL, 'happy-new-year-2019', 0, NULL, NULL, NULL, '2018-12-29 20:00:00', '2019-07-27 14:02:59', NULL),
(11, 'NEWS19013001', 1, 'Web Application Development', NULL, NULL, NULL, 'Web applications evolved from Web sites or Web systems.\nA Web application builds on and extends a Web system to add business functionality.\n\nContact\nWhatsapp 087871113361', NULL, 'news19013001.jpg', NULL, NULL, NULL, 'web-application-development', 0, NULL, NULL, NULL, '2019-01-29 06:00:00', '2019-07-27 14:02:59', NULL),
