(15, 'NEWS20122401', 2, 'Merry Christmas and Happy New Year 2021', NULL, NULL, NULL, '<p>Damai Kristus Yesus melingkupi kita, rasakan malam natal yang indah..Hadiah yang terbaik bukanlah hadiah yang paling mahal.Hadiah yang terindah bukanlah yang ada di pohon natal.Hadiah yang terindah dan terbagus adalah Natal itu sendiri, kelahiran Tuhan..Damai di Bumi, Damai di Hati. Biarlah Damai dan Kasih Kristus serta Sukacita Natal menyertai hari hari kita.Selamat Natal..Christmas EveMerry Christmas 2018Happy New Year 2019.Yesaya 9 : 6 \"Sebab seorang anak telah lahir untuk kita, seorang putera telah diberikan untuk kita; lambang pemerintahan ada di atas bahunya, dan namanya disebutkan orang: Penasihat Ajaib, Allah yang Perkasa, Bapa yang Kekal, Raja Damai.\" ..DIW.co.id Teams.#gereja #ibadah #church #kristen #natal #christmas #christmastree #christmaseve #christ #christmasday #trending #photography #photo #winter #beauty #life #lifestyle #instagram #instagramers #instagood #photooftheday #yesus #kristus #happy #cute #pictureoftheday #picture #ootd #love #amazing<br></p>', NULL, 'merry-christmas-and-happy-new-year-2021.webp', NULL, NULL, '2020-12-24 00:00:00', 'merry-christmas-and-happy-new-year-2021', 1, NULL, NULL, NULL, '2020-12-23 10:00:00', '2021-07-29 08:43:18', NULL),
