(19, 'NEWS21040401', 2, 'Happy Easter 2021', NULL, NULL, NULL, '<div><span style=\"font-size: 13.2px;\">Happy Easter 2021!</span></div><div><span style=\"font-size: 13.2px;\"><br></span></div><div><span style=\"font-size: 13.2px;\">By His mercy and grace, He turn us from nothing into something precious. May His sacrifice strengthened faith, hope, and love in you.</span></div><div><span style=\"font-size: 13.2px;\"><br></span></div><div><span style=\"font-size: 13.2px;\">Easter is the time to remember the sacrifice made by Lord Christ and his unconditional love. Let us follow the right path shown by the Son of God.</span></div><div><span style=\"font-size: 13.2px;\"><br></span></div><div><span style=\"font-size: 13.2px;\">Easter brings fun, Easter brings Happiness, Easter brings God’s endless blessings, Easter brings love and the freshness of spring.</span></div><div><span style=\"font-size: 13.2px;\"><br></span></div><div><span style=\"font-size: 13.2px;\">I wish that the Holy Easter morning bells and psalms bring hope, peace and good luck to our home. Let us open our souls for love, kindness, and joy for you and your family an Easter season filled with peace, joy, and the spirit of renewal.</span></div><div><span style=\"font-size: 13.2px;\"><br></span></div><div><span style=\"font-size: 13.2px;\">Wishing you a blessed Easter. May God fill your Easter basket with happiness. May you enjoy this Easter surrounded by friends, family, and plenty of chocolate.</span></div><div><span style=\"font-size: 13.2px;\"><br></span></div><div><span style=\"font-size: 13.2px;\">God bless you now and always. Have a blessed holiday filled with happiness, love, and faith!</span></div><div><span style=\"font-size: 13.2px;\"><br></span></div><div><span style=\"font-size: 13.2px;\"><br></span></div><div><span style=\"font-size: 13.2px;\"><br></span></div><div><span style=\"font-size: 13.2px;\">Selamat Paskah 2021!</span></div><div><span style=\"font-size: 13.2px;\"><br></span></div><div><span style=\"font-size: 13.2px;\">Dengan belas kasihan dan rahmat-Nya, Ia mengubah sesuatu yang tidan berharga menjadi sesuatu yang mulia. Semoga pengorbanan-Nya meneguhkan iman, harapan dan kasih di dalam hatimu.</span></div><div><span style=\"font-size: 13.2px;\"><br></span></div><div><span style=\"font-size: 13.2px;\">Paskah adalah momen untuk mengingat pengorbanan yang dilakukan oleh Tuhan Kristus dan kasih-Nya yang tanpa syarat. Mari kita mengikuti jalan yang benar yang ditunjukkan oleh Anak Allah.</span></div><div><span style=\"font-size: 13.2px;\"><br></span></div><div><span style=\"font-size: 13.2px;\">Paskah membawa kesenangan, Paskah membawa Kebahagiaan, Paskah membawa berkah Tuhan yang tak berkesudahan, Paskah membawa cinta dan kesegaran musim semi</span></div><div><span style=\"font-size: 13.2px;\"><br></span></div><div><span style=\"font-size: 13.2px;\">Saya berharap bahwa lonceng dan mazmur pagi Paskah yang suci membawa harapan, kedamaian, dan keberuntungan. Mari buka jiwa kita untuk cinta, kebaikan, dan sukacita untuk Anda dan keluarga merayakan Paskah yang penuh dengan kedamaian, kegembiraan, dan semangat pembaruan.</span></div><div><span style=\"font-size: 13.2px;\"><br></span></div><div><span style=\"font-size: 13.2px;\">Semoga Paskahmu diberkati. Semoga Tuhan mengisi Paskahmu dengan kebahagiaan. Semoga kamu menikmati Paskah ini dengan dikelilingi oleh teman, keluarga, dan juga banyak coklat.</span></div><div><span style=\"font-size: 13.2px;\"><br></span></div><div><span style=\"font-size: 13.2px;\">Tuhan memberkatimu selalu. Selamat menikmati liburan yang diberkati yang diisi dengan kebahagiaan, cinta, dan iman!</span></div>', NULL, 'happy-easter-2021.webp', NULL, NULL, '2021-04-04 21:03:59', 'happy-easter-2021', 1, NULL, NULL, NULL, '2021-04-04 02:09:45', '2021-04-04 07:04:22', NULL),
(20, 'NEWS21041301', 2, 'Ramadan Kareem 2021', NULL, NULL, NULL, '<p><span style=\"font-size: 13.2px;\">Ramadhan adalah waktu terbaik untuk membuat kebiasaan baik atau menghentikan kebiasaan buruk.</span><span style=\"font-size: 13.2px;\"><br></span></p><p><span style=\"font-size: 13.2px;\">Ketika datang Bulan Ramadhan, maka pintu-pintu surga akan dibuka, pintu-pintu neraka ditutup, dan setan-setan dibelenggu. Selamat menunaikan ibadah puasa, mohon dibukakan segala pintu maaf atas semua kesalahan.</span></p>', NULL, 'ramadan-kareem-2021.webp', NULL, NULL, '2021-04-13 00:00:00', 'ramadan-kareem-2021', 1, NULL, NULL, NULL, '2021-04-15 07:39:26', '2021-04-15 07:39:26', NULL),
(21, 'NEWS21051301', 2, 'Selamat Hari Raya Idul Fitri 2021', NULL, NULL, NULL, '<p><span style=\"font-size: 13.2px;\">Sambutlah hari kemenangan dengan bahan paling baik.</span></p><p><span style=\"font-size: 13.2px;\">Bahan kesabaran dengan benangnya kesucian dihiasi dengan keikhlasan yang dijahit sebulan.</span></p><p><span style=\"font-size: 13.2px;\">Selamat Lebaran mohon maaf atas segala kesalahan.</span></p>', NULL, 'selamat-hari-raya-idul-fitri-2021.webp', NULL, NULL, '2021-05-13 00:00:00', 'selamat-hari-raya-idul-fitri-2021', 1, NULL, NULL, NULL, '2021-04-15 07:41:01', '2021-05-11 23:24:36', NULL),
(22, 'NEWS21051302', 2, 'Ascendion Day 2021', NULL, NULL, NULL, '<div><span style=\"font-size: 13.2px;\">Christ is now in that place of peace,</span></div><div><span style=\"font-size: 13.2px;\">which is with everything taken into account.</span></div><div><span style=\"font-size: 13.2px;\">He is on the correct hand of God.</span></div><div><span style=\"font-size: 13.2px;\">Jesus is covered up in the splendor of the brilliance which issues from the everlasting royal position.</span></div><div><span style=\"font-size: 13.2px;\">Happy Ascension Day!</span></div>', NULL, 'ascendion-day-2021.webp', NULL, NULL, '2021-05-13 00:00:00', 'ascendion-day-2021', 1, NULL, NULL, NULL, '2021-05-12 00:23:29', '2021-05-12 00:23:29', NULL),
(23, 'NEWS21060101', 2, 'Selamat Hari Pancasila', NULL, NULL, NULL, '<div><span style=\"font-size: 13.2px;\">Berbeda tapi tetap bersatu untuk Indonesia tangguh.</span></div><div><span style=\"font-size: 13.2px;\"><br></span></div><div><span style=\"font-size: 13.2px;\">Jaga kebhinekaan, jaga kerukunan, saling menghargai dan menghormati.</span></div><div><span style=\"font-size: 13.2px;\"><br></span></div><div><span style=\"font-size: 13.2px;\">Bersama-sama wujudkan Indonesia tangguh dan berkeadilan sosial dengan selalu menanamkan nilai-nilai Pancasila dalam diri kita.</span></div><div><span style=\"font-size: 13.2px;\"><br></span></div><div><span style=\"font-size: 13.2px;\">Selamat memperingati Hari Lahir Pancasila 1 Juni 2021.</span></div>', NULL, 'selamat-hari-pancasila.jpg', NULL, NULL, '2021-06-01 00:00:00', 'selamat-hari-pancasila', 1, NULL, NULL, NULL, '2021-06-01 11:14:28', '2021-06-01 11:14:28', NULL),
(24, 'NEWS21081701', 2, 'Indonesian Independence Day 76th', NULL, NULL, NULL, '<p><span style=\"font-size: 13.2px;\">Merayakan Hari Kemerdekaan di tengah situasi sulit memang tak mudah. Tapi, jangan lupa tetap semangat dan berpikir positif bahwa kelak Indonesia akan keluar dari masa sulit ini.</span></p><p><span style=\"font-size: 13.2px;\"><br></span></p><p><span style=\"font-size: 13.2px;\">Kemerdekaan tak ditujukan untuk orang-orang yang berhenti berjuang. Kemerdekaan adalah untuk mereka yang pantang menyerah menggapai cita.</span></p><p><span style=\"font-size: 13.2px;\"><br></span></p><p><span style=\"font-size: 13.2px;\">Merah darah pahlawan tertumpah di tanah Ibu Pertiwi. Putih tulang para pejuang tertanam dalam Tanah Air Indonesia tercinta. Di sini kita terlahir, di sini pula kita tiada. Selamat HUT ke-76 RI!. Dirgahayu Republik Indonesia!</span></p><div><br></div>', NULL, 'indonesian-independence-day-76th.webp', NULL, NULL, '2021-08-17 00:00:00', 'indonesian-independence-day-76th', 1, NULL, NULL, NULL, '2021-08-17 06:39:54', '2021-08-17 06:39:54', NULL),
