INSERT INTO `portfolios` (`id`, `code`, `portfolio_category_id`, `user_id`, `username_cpanel`, `password_cpanel`, `status`, `name`, `short_description`, `description`, `link`, `price`, `logo`, `image_1`, `image_2`, `image_3`, `image_4`, `image_5`, `testimonial`, `source_testimonial`, `expired`, `datetime`, `notes`, `is_publish`, `slug`, `is_active`, `created_by_id`, `updated_by_id`, `deleted_by_id`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'PORTFOLIO000001', 2, 10, 'diwr4986', '2TFrK6RMeoGIPESpOJbW', 1, 'Develop Inspire Website', NULL, 'DIW (Develop Inspire Website) adalah sebuah jasa pembuatan website dengan teknik PHP dan database mysql yang menghubungkan anda dengan situs website. Kami membantu anda pada usaha atau company profile yang anda buat untuk terhubung secara online. Kebanyakan sekarang ini, para masyarakat sudah menggunakan komputer, laptop, maupun smartphone. Tentu hal ini memudahkan para masyarakat mengetahui usaha atau profile anda secara mudah dan di akses oleh seluruh pengguna, mulai dari kota anda, negara anda(indonesia), bahkan di internasional! Tentu kami menawarkan harga dan fitur beda dari yang lain. Harga yang kami tawarkan tidak murah, kenapa? Karena kami mengkoding dari awal dengan memakai PHP code dan perpaduan SQL Database. Kemudian untuk fitur, kami menggunakan hosting dan domain yang ternama. White SEO, Database Produk Anda, dan kami tetap memfollow anda.', '//www.developinspirewebsite.com', 0, 'logo-develop-inspire-website.webp', 'develop-inspire-website-1.webp', 'develop-inspire-website-2.webp', 'develop-inspire-website-3.webp', 'develop-inspire-website-4.webp', 'develop-inspire-website-5.webp', NULL, NULL, '2022-06-17', '2015-10-27 00:00:00', NULL, 1, 'develop-inspire-website', 1, NULL, NULL, NULL, '2015-10-25 20:00:00', '2022-04-29 06:41:22', NULL),
(2, 'PORTFOLIO000002', 4, 11, 'andrisun', 'j-qIZ2.H4kd65F', 1, 'Andri Sunardi', NULL, 'Hi. My Name is Andri Sunardi. I Work at DIW.co.id (Develop Inspire Website) as a Founder and CEO. I became freelancer to create website for client with their requirements. My passion is a code and learn about information technology.', '//www.andrisunardi.com', 0, 'logo-andri-sunardi.webp', 'andri-sunardi-1.webp', 'andri-sunardi-2.webp', 'andri-sunardi-3.webp', 'andri-sunardi-4.webp', 'andri-sunardi-5.webp', NULL, NULL, '2022-06-17', '2015-11-12 00:00:00', 'Rumah Webande2795Andrisunardi25!', 1, 'andri-sunardi', 1, NULL, NULL, NULL, '2015-11-10 20:00:00', '2022-04-29 06:41:29', NULL),
(3, 'PORTFOLIO000003', 5, 11, '', '', 1, 'Forum Universitas Buddhi Dharma', NULL, 'Forum Universitas Buddhi Dharma \nadalah komunitas jaringan online untuk berdikusi maupun pembelajaran online pada Universitas Buddhi Dharma.', '', 0, 'logo-forum-universitas-buddhi-dharma.webp', 'forum-universitas-buddhi-dharma-1.webp', 'forum-universitas-buddhi-dharma-2.webp', 'forum-universitas-buddhi-dharma-3.webp', 'forum-universitas-buddhi-dharma-4.webp', 'forum-universitas-buddhi-dharma-5.webp', '', '', NULL, '2015-04-10 07:00:00', '', 1, 'forum-universitas-buddhi-dharma', 1, NULL, NULL, NULL, '2015-04-08 20:00:00', '2020-11-07 08:03:42', NULL),
(4, 'PORTFOLIO000004', 6, 28, 'aflash_game', 'game2014!$', 1, 'AFlashGame', NULL, 'AFlashGame adalah Website Gratis (Free To Play) dan di kelola secara professional oleh Manajemen AFlashGame dengan di bantu oleh Admin dan Staff kami. Web AFlashGame adalah milik bersama, untuk itu peran serta kalian untuk menjaga kelangsungan Web AFlashGame sangat kami hargai.', 'http://www.aflashgame.com', 0, 'logo-aflashgame.webp', 'aflashgame-1.webp', 'aflashgame-2.webp', 'aflashgame-3.webp', 'aflashgame-4.webp', 'aflashgame-5.webp', 'Walau masih muda dan statusnya masih duduk di bangku kuliah, \nAndri Sunardi merupakan pemuda yang memiliki keinginan besar dalam mengembangkan usahanya.\n\nJasa pembuatan web yang dijalankannya ini sangatlah memuaskan. Dari desian yang menarik hingga sistem managemen website yang disediakan \nmembuat user lebih mudah dalam melakukan pembaruan pada situs webnya.\n\nDan bagi yang ingin memiliki usaha seperti eCommerce atau sekedar memperkenalkan perusahaannya di internet, disinilah tempatnya.\n\nBy William Tansil\nCEO Mygies Interactive\nThe First Winner of Reality Bytes Contest, Mochimedia, San Fransisco', '', '2014-12-04', '2013-12-04 07:00:00', '', 1, 'aflashgame', 1, NULL, NULL, NULL, '2013-12-02 20:00:00', '2020-11-07 08:03:42', NULL),
(5, 'PORTFOLIO000005', 11, 2, 'plati410', '9o90xG6vJe', 1, 'Platinum Notebook', NULL, 'Specialist in sales, accessories, service notebook, spare part & repair\nJual: Adaptor, Keyboard, Battery, LCD, HDD, DVD Combo, DVD RW, Memory\n\nHEAD OFFICE\n\nPlatinum Notebook\nHarco Mangga Dua Lt.1 Hall Tengah C No. M 23\nJl. Mangga Dua Raya, Jakarta Pusat 10730 \nFax: 021 623 07 398\nTel: 021 623 07 833\nTel: 93 178 829\nTel: 0818 885 629\nBBM: 25AD7CBE\nE-mail: platinumnotebook@yahoo.co.id', 'http://www.platinumnotebook.com', 500000, 'logo-platinum-notebook.webp', 'platinum-notebook-1.webp', 'platinum-notebook-2.webp', 'platinum-notebook-3.webp', 'platinum-notebook-4.webp', 'platinum-notebook-5.webp', 'Mohon maaf andri, saya baru sempat memberikan testimoni nya.\nSaya tahu jasa website andri dari anak teman saya, Tommy Septiandy.\nUntuk design cukup simple dan tidak ribet.\nDan juga semua dagangan dapat di lihat secara oniine.', '', '2015-07-10', '2014-06-16 07:00:00', '', 1, 'platinum-notebook', 1, NULL, NULL, NULL, '2014-06-14 20:00:00', '2020-11-07 08:03:42', NULL),
(7, 'PORTFOLIO000007', 4, 3, '', '', 1, 'Alex Hardikoesoemo', NULL, 'MMM Mavrodi Indonesia adalah komunitas dimana semua anggotanya saling membantu yang dilengkapi dengan sistem Provide Help dan Get Help.\nSudah ribuan orang menjadi member kami, ayo bergabung bersama kami, komunitas paling oke, segera daftar, dan bergabung dengan kami.', 'http://www.hardikoesoemo.com', 1000000, 'logo-alex-hardikoesoemo.webp', 'alex-hardikoesoemo-1.webp', 'alex-hardikoesoemo-2.webp', 'alex-hardikoesoemo-3.webp', 'alex-hardikoesoemo-4.webp', 'alex-hardikoesoemo-5.webp', 'Dengan adanya website, saya menjadi banyak follower dan tambah terkenal. DIW membuat saya menjadi banyak pengikut dan mengetahui tentang jasa yang saya buat. Terima kasih DIW.', '', '2016-02-18', '2015-02-14 07:00:00', '', 1, 'alex-hardikoesoemo', 1, NULL, NULL, NULL, '2015-02-12 20:00:00', '2020-11-07 08:03:42', NULL),
(8, 'PORTFOLIO000008', 2, 5, 'cvsdj422', 'Diw.co.id2015!', 1, 'CV Star Delta Jaya Abadi', NULL, 'CV Star Delta Jaya Abadi adalah salah satu perusahaan yang bergerak di bidang subkontraktor, Mekanilak Elektrikal (ME).\r\nTim pekerjaan kami adalah tenaga ahli dan terlatih di bidang masing-masing pekerjaan, yaitu:\r\n\r\n1. Instalasi listrik dan semua sistem arus kuat.\r\n2. Instalasi arus lemah, sistem fire alarm, sistem telfon, sistem data wireless, sistem sound.\r\n3. Instalasi pemadam kebakaran dan sistem setting pompa HYDRANT SPLINKLER.\r\n4. Instalasi pipa2 AC dan sistem seting indoor outdoor Ac, AHU, FCU, CILER.\r\n5. Instalasi Ducting BJLS, DUCTING FIU.', 'http://www.cvsdja.com', 1300000, 'logo-cv-star-delta-jaya-abadi.webp', 'cv-star-delta-jaya-abadi-1.webp', 'cv-star-delta-jaya-abadi-2.webp', 'cv-star-delta-jaya-abadi-3.webp', 'cv-star-delta-jaya-abadi-4.webp', 'cv-star-delta-jaya-abadi-5.webp', NULL, NULL, '2019-10-29', '2015-08-20 07:00:00', NULL, 1, 'cv-star-delta-jaya-abadi', 1, NULL, NULL, NULL, '2015-08-18 20:00:00', '2021-03-16 09:34:05', NULL),
(9, 'PORTFOLIO000009', 2, 6, 's3cz5462', 'Andrisunardi25!', 2, 'S3 CCTV', NULL, 'Buatlah diri anda dan keluarga merasa aman di rumah, ataupun tempat usaha anda tanpa ada kekhawatiran seseorang yang tidak diundang masuk. S3 CCTV akan memantau setiap sisi rungan, baik didalam maupun di luar rumah atau tempat usaha anda.', 'http://www.s3-cctv.com', 500000, 'logo-s3-cctv.webp', 's3-cctv-1.webp', 's3-cctv-2.webp', 's3-cctv-3.webp', 's3-cctv-4.webp', 's3-cctv-5.webp', 'Website DIW ini sangat baik dirancang dan dipublish. Dulu saya hanya menjual lewat toko secara offline. Tapi sekarang saya bisa menjualnya dan mempromosikan nya secara Online\n\nKamera CCTV kami menjadi sangat laku dan dikenal oleh masyarakat. Jika anda berminat mempromosikan jualan anda, boleh kontak ke teman saya ini.\n\nSemoga sukses usaha jasa buat website nya.\nGood Luck DIW.', '', '2021-10-03', '2015-09-16 07:00:00', '', 1, 's3-cctv', 1, NULL, NULL, NULL, '2015-09-14 20:00:00', '2020-11-07 08:03:42', NULL),
(10, 'PORTFOLIO000010', 7, 7, 'apod4136', 'Andrisunardi25!', 1, 'Apostolic City Church', NULL, 'By the grace and mercy of the Lord Jesus, <u><strong>GBI ACC</strong></u> has been established since October 9th, 2005 in a commercial Mall Metropolis Tangerang with Vision \"Building a church sanctuary, mature, and experienced a breakthrough\" so that we could be able to:\n\n1. Transform The Communities\n2. Influence The Cities\n3. Impact The Nations.', 'https://www.apostoliccitychurch.org', 604821, 'logo-apostolic-city-church.webp', 'apostolic-city-church-1.webp', 'apostolic-city-church-2.webp', 'apostolic-city-church-3.webp', 'apostolic-city-church-4.webp', 'apostolic-city-church-5.webp', 'Dengan adanya website Apostolic City Church, jemaat dapat melihat informasi dan kegiatan berlangsung.\nTerima kasih saudara Andri yang sudah membuatkan website Gereja Kita ini.\n\nGod Bless You.', '', '2017-10-05', '2015-10-01 07:00:00', '', 1, 'apostolic-city-church', 1, NULL, NULL, NULL, '2015-09-29 20:00:00', '2020-11-07 08:03:42', NULL),
