(12, 'PORTFOLIO000012', 2, 8, 'skyt4631', 'Andrisunardi25!', 1, 'Skylite Surya Internusa', NULL, 'Pada Tahun 2004 Tia Tian Po mendirikan PT. Skylite Surya Internusa di Daerah Tangerang karena dahulu sangat sedikit persaingan di industri lampu Led sehingga kami pun bekerja sama dengan perusahaan Philips sebuah perusahaan yang khusus memproduksi LED Saving Energy Lamp dan produknya dapat diterima di mancanegara.\n\nDengan dukungan dari perusahaan raksasa tersebut sejak tahun 2004 PT.Skylite Surya internusa memasarkan Led Saving energy Lamp merk â€œSKYLITEâ€ di Indonesia,\n\nSebagai Distributor Lampu LED MERK â€œSKYLITEâ€ Perusahaan kami telah Dipercaya Oleh Perusahaan Swasta Maupun milik Negara, LED Saving energy lamps sangat membantu perusahaan didalam penghematan energy listrik yang otomatis dalam penghematan biaya oprasional yang cukup baik. ', 'http://www.skylitesuryainternusa.com', 1300000, 'logo-skylite-surya-internusa.webp', 'skylite-surya-internusa-1.webp', 'skylite-surya-internusa-2.webp', 'skylite-surya-internusa-3.webp', 'skylite-surya-internusa-4.webp', 'skylite-surya-internusa-5.webp', 'Saya di kenalkan dari temen saya ini si agan Andri Sunardi\nDia sudah membuat banyak website, mulai dari offline dan online.\n\nDIW memang bagus-bagus websitenya. Pengerjaannya juga ga lama, hanya sekitar 3 minggu jadi.\nMemang banyak revisi dari saya.\n\nPelayanan ama berkelas website mas Andri\nSukses selalu mas Andri', '', '2016-11-25', '2015-10-08 07:00:00', '', 1, 'skylite-surya-internusa', 1, NULL, NULL, NULL, '2015-10-06 20:00:00', '2020-11-07 08:03:42', NULL),
(13, 'PORTFOLIO000013', 14, 12, '', '', 1, 'Travelment', NULL, 'Travelment.com adalah situs penjualan tiket bus, shuttle, dan travel online terbesar di Indonesia yang dimiliki dan dioperasikan oleh PT Media Baru Digital. Saat ini sudah ada puluhan operator penyedia jasa transportasi darat seperti Perusahan Otobus (PO), shuttle dan travel dan terus bertambah. Travelment melayani beragam rute dari dan ke berbagai tujuan di Indonesia.\n\nSelain akses melalui website, Travelment juga akan segera hadir dalam bentuk aplikasi mobile di Google Playstore untuk smartphone Android dan Appstore untuk smartphone iOS Apple sehingga akan lebih memudahkan Anda untuk membeli tiket kapan pun dan dimana pun.\n\nTravelment memiliki tim yang professional dan handal dengan pengalaman lebih dari 10 tahun di industri website dan online di Indonesia. Travelment juga didukung oleh pendanaan yang sangat kuat yang dibutuhkan untuk memasarkan dan mengenalkan website Travelment ke seluruh masyarakat Indonesia.\n\nTravelment juga memiliki tim Customer Service yang siap melayani semua pertanyaan, komentar maupun keluhan 24 jam setiap harinnya. Kami siap untuk membantu semua kebutuhan Anda yang berhubungan dengan beli tiket bus, shuttle maupun travel di Indonesia.', '', 1500000, 'logo-travelment.webp', 'travelment-1.webp', 'travelment-2.webp', 'travelment-3.webp', 'travelment-4.webp', 'travelment-5.webp', 'Profesional, project diselesaikan sebelum deadline. Harga bersahabat, hasilpun hebat.\n\nSemoga ke depannya dapat bekerja sama lagi.', '', NULL, '2016-01-02 07:00:00', '', 1, 'travelment', 1, NULL, NULL, NULL, '2015-12-31 20:00:00', '2020-11-07 08:03:42', NULL),
(14, 'PORTFOLIO000014', 2, 13, '', '', 1, 'Sinar Bhakti Perkasa', NULL, 'PT. Sinar Bhakti Perkasa didirikan pada tahun 2004 dengan pemilik perusahaan yang bernama  Herman Otang. Perusahaan ini merupakan salah satu perusahaan yang bergerak dalam bidang general kontraktor di Indonesia yang menawarkan jasa-jasa dalam seputar kegiatan kontraktor.\n\nPerusahaan ini selalu ingin memaksimalkan kinerja mereka dalam segi apapun, dan salah satunya dalam segi kualitas jasa yang ditawarkan dan pelayanan yang disajikan untuk konsumen sehingga perusahaan ini bisa memiliki pelanggan yang cukup banyak dan memperoleh omset perbulan hingga Rp. 250.000.000.\n\nPT. Sinar Bhakti Perkasa terletak di Jalan Merdeka Komplek Perum Pabuaran Indah Blok B nomor 1-2 Tangerang Pada awal mulanya perusahaan ini hanya memepekerjakan keluarga mereka, hingga sampai saat ini mereka sudah bisa merekrut karyawan-karyawan untuk menunjang proses bisnis PT. Sinar Bhakti Perkasa yang berjumalah sekitar 120 orang.', '', 2500000, 'logo-sinar-bhakti-perkasa.webp', 'sinar-bhakti-perkasa-1.webp', 'sinar-bhakti-perkasa-2.webp', 'sinar-bhakti-perkasa-3.webp', 'sinar-bhakti-perkasa-4.webp', 'sinar-bhakti-perkasa-5.webp', 'Thx buat andri dengan jasa webnya, web yang gw mw bisa tercapai walaupun dengan deadline yg pendek, tapi semua komponen yang diinginkan bisa tercapai..\n\nRecomen bgt deh buat yg pingin nyari jasa web, dan bisa langsung konsultasi sama orgnya tanpa ribet', '', NULL, '2016-01-09 07:00:00', '', 0, 'sinar-bhakti-perkasa', 1, NULL, NULL, NULL, '2016-01-07 20:00:00', '2020-11-07 08:03:42', NULL),
(15, 'PORTFOLIO000015', 18, 14, 'u360099169_user', 'kayakita.com', 1, 'Kaya Kita', NULL, 'KayaKita adalah sebuah bisnis yang memberikan banyak promo-promo menarik dari berbagai macam vendor yang bekerja sama.\n\nMulai dari Kuliner, Pendidikan, Fashion, Travelling, Wahana Bermain, Hiburan, Kesehatan & Kecantikan.\n\nPromo tersebut berbede-beda setiap bulannya dan dapat dinikmati oleh seluruh anggota bisnis komunitas KayaKita.\n\nSyarat : Wajib Qualified. (Sudah memiliki 3 Partner/Downline) Untuk menikmati berbagai macam promo-promo menarik yang berbeda setiap bulannya.\n\n-JALANKAN BISNISNYA & NIKMATI PROMO-PROMONYA-', 'http://www.kayakita.com', 5000000, 'logo-kaya-kita.webp', 'kaya-kita-1.webp', 'kaya-kita-2.webp', 'kaya-kita-3.webp', 'kaya-kita-4.webp', 'kaya-kita-5.webp', 'Keahlian programmer Develop Inspire Website (DIW) yang sangat handal mampu menciptakan sistem-sistem yang anda inginkan pada website anda.\n\nWaktu pengerjaannya tidak lama bahkan, terbilang sangat cepat dan programmer DIW selalu siap untuk membantu mengembangkan ide untuk kesempurnaan sistem pada website anda.\n\nSangat direkomendasikan bagi anda yang ingin menciptakan website dengan kualitas jempolan dan desain yang elegan.\n\n-Kenny- (Founder KayaKita)', '', '2017-03-04', '2016-03-04 07:00:00', '', 1, 'kaya-kita', 1, NULL, NULL, NULL, '2016-05-01 20:00:00', '2020-11-07 08:03:42', NULL),
(16, 'PORTFOLIO000016', 1, 15, '', '', 1, 'PT Sinar Bhakti Perkasa', NULL, 'PT Sinar Bhakti Perkasa didirikan oleh Herman Otangpada tahun 2005.PT Sinar Bhakti Perkasa adalah perusahaan yang bergerak di bidang General Contractor, Supplier, & Heavy Equipment, sebelumnya bernama PD Sinar Bakti yang berdiri pada tahun 1985 di Jl Merdeka Raya Perum, Pabuaran Indah Blok A No.4 Tangerang, yang kemudian berkembang dan berubah nama menjadi PT Sinar Bhakti pada tahun 2005. Pada saat itu perusahaan dibidang kontraktor terhitung jarang. Hal ini sangat mendukung perkembangan PT Sinar Bhakti Perkasa untuk terus berkembang pada saat itu.\n\nHingga sekarang ini, proyek-proyek yang ditangani termasuk besar di Kota Tangerang, dan banyak proyek-proyek yang ditangani oleh PT Sinar Bhakti Perkasa. Selain proyek-proyek yang ditangani, PT Sinar Bhakti Perkasa juga menyewakan berbagai alat seperti: Excavator Hitachi, Vibro, Buldosser, Excavator Kobelko, dan lainnya. Dan PT Sinar Bhakti juga menyewakan mobilisasi yaitu: Trailler yang juga di butuhkan untuk mengirim alat-alat tersebut ke lokasi tujuan dan Dump Truck Tronton yang digunakan untuk mengambil dan buangan tanah di setiap proyek serta material-material seperti: Batu Mahkadam, Split, Pasir, Abu Batu, dan lainnya. PT Sinar Bhakti Perkasa awal mulanya dibidang cut and fill, Stripping, dan sekarang mulai berkembang dibidang Kontruksi.', '', 500000, 'logo-pt-sinar-bhakti-perkasa.webp', 'pt-sinar-bhakti-perkasa-1.webp', 'pt-sinar-bhakti-perkasa-2.webp', 'pt-sinar-bhakti-perkasa-3.webp', 'pt-sinar-bhakti-perkasa-4.webp', 'pt-sinar-bhakti-perkasa-5.webp', 'Good Job Andri, bro yang satu ini teman kampus saya. Sorry ya dri kalau saya minta revisi terus.\nSukses terus usaha jasa websitenya', '', NULL, '2016-04-01 07:00:00', '', 1, 'pt-sinar-bhakti-perkasa', 1, NULL, NULL, NULL, '2016-03-30 20:00:00', '2020-11-07 08:03:42', NULL),
(17, 'PORTFOLIO000017', 18, 14, 'kiosmbc89', 'kiosmbc.com', 1, 'Kios MBC', NULL, 'Salah satu peluang bisnis yang akan selalu tumbuh adalah sektor pariwisata baik wisata dalam negeri maupun luar negeri. Di mana jumlah wisatawan yang bepergian ke luar negeri selalu meningkat tiap tahunnya. Begitu pula sebaliknya jumlah wisatawan yang masuk ke Indonesia juga selalu meningkat tiap tahunnya, lebih dari 700.000 orang perbulan datang ke Indonesia (sumber : bps.go.id)\n\nMelihat peluang emas tersebut maka empat orang yang menamai diri mereka Young Executive Travelpreneur bersepakat dan bersemangat untuk bersama - sama mendirikan suatu usaha Tour and Travel.\n\nTidak hanya sebagai layanan Tour and Travel saja, pada bisnis yang didirikan ini ada pula inovasi yang dihadirkan seperti layanan PPOB, layanan pembayaran PLN, PAM, BPJS, Pulsa All Operator, UMROH, dan ke depan akan semakin banyak lagi inovasi yang akan dihadirkan.\n\nTak berhenti disitu saja, keempat Young Executive Travelpreneur tersebut juga ingin berbagi manfaat dan profit dengan masyarakat luas sebagai bentuk dukungan terhadap kemajuan ekonomi bangsa dengan membuka kemitraan peluang bisnis Tour and Travel dengan harga sangat terjangkau namun hasil yang maksimal.\n\nSelain itu, untuk lebih mendukung terciptanya para Travelpreneur yang luar biasa di Indonesia, juga disediakan pelatihan Exclusive bersama Executive Trainer dan Business Coach yang handal untuk semakin meningkatkan profit para mitra yang ada.', 'http://www.kiosmbc.com', 1000000, 'logo-kios-mbc.webp', 'kios-mbc-1.webp', 'kios-mbc-2.webp', 'kios-mbc-3.webp', 'kios-mbc-4.webp', 'kios-mbc-5.webp', 'Develop Inspire Website :\nSistem KIOSMBC yang sangat luar biasa dapat diciptakan oleh Programmer DIW hanya dalam waktu 2 minggu. Desain yang elegan selalu menjadi ciri khas dari website-website yang dibuat oleh DIW. Setelah website jadi, DIW terus melakukan maintenance terhadap website tersebut untuk memastikan sistem di website tersebut benar-benar sempurna.\n\nKesimpulan, DIW memiliki programmer yang luar biasa handal dan professional serta paham akan nilai-nilai estetika seni karena dalam website yang dibuat oleh DIW selalu tercermin beberapa elemen-elemen estetika seni.\n\n-Kenny- (Founder KIOSMBC)', '', '2017-04-28', '2016-04-12 07:00:00', '', 1, 'kios-mbc', 1, NULL, NULL, NULL, '2016-04-10 20:00:00', '2020-11-07 08:03:42', NULL),
(18, 'PORTFOLIO000018', 1, 16, '', '', 1, 'Klinik Dokter Gigi Drg Titin Sumarni', NULL, 'Praktek Dokter Gigi drg.Titin Sumarni berdiri pada tahun 2003 sampai dengan sekarang yang berlokasi di Jl. Iskandar Muda no.28 Sewan Neglasari Tangerang Banten, drg.Titin Sumarni lulusan dari Universitas Trisakti Jakarta pada tahun 1999. Setelah lulus saya ditugaskan pada ikatan dinas pemerintah di puskesmas Tilamuta, Gorontalo selama 2 tahun. Pada tahun 2001 saya sempat bergabung di Klinik 24 jam di Kebon Nanas Tangerang sampai tahun 2003 dan akhirnya mulai merintis praktek gigi sendiri yang dimulai dari nol dengan keterbatasan yang ada. Kini saya sudah memilik ratusan pasien yang selalu datang ke tempat praktek gigi saya. a.Visi 1)Bekerja memberikan yang terbaik buat Tuhan Yesus. 2)Melayani pasien sesuai dengan etika kedokteran gigi yang berlaku. b.Misi 1)Agar pasien menyadari pentingnya menjaga dan merawat kebesihan gigi dan mulut.', '', 1500000, 'logo-klinik-dokter-gigi-drg-titin-sumarni.webp', 'klinik-dokter-gigi-drg-titin-sumarni-1.webp', 'klinik-dokter-gigi-drg-titin-sumarni-2.webp', 'klinik-dokter-gigi-drg-titin-sumarni-3.webp', 'klinik-dokter-gigi-drg-titin-sumarni-4.webp', 'klinik-dokter-gigi-drg-titin-sumarni-5.webp', 'Andri, terima kasih untuk programnya Saya senang sekali di bantu oleh agan Andri Sesuai dengan perkiraan yang mau ane buat websitenya Thank you bro!', '', NULL, '2016-04-18 07:00:00', '', 1, 'klinik-dokter-gigi-drg-titin-sumarni', 1, NULL, NULL, NULL, '2016-04-16 20:00:00', '2020-11-07 08:03:42', NULL),
(19, 'PORTFOLIO000019', 3, 17, 'sakm3476_sakura', 'Andrisunardi280195!', 2, 'Sakura Kita', NULL, 'Sakurakita - Kita Bangun Indonesia Walau dari Negeri Sakura.\n\nMedia Bisnis dan Informasi khusus masyarakat Indonesia yang berada di Jepang maupun di Indonesia. Bersama Sakurakita membangun Indonesia walau dari negeri Sakura.', 'http://www.sakurakita.com', 4000000, 'logo-sakura-kita.webp', 'sakura-kita-1.webp', 'sakura-kita-2.webp', 'sakura-kita-3.webp', 'sakura-kita-4.webp', 'sakura-kita-5.webp', 'Thank you bro Andri Sunardi\nGa kecewa dengan ente gan\nAne cek portfolio sebelum ane beli jasa di ente, cakep2 semua\n\nGa mengecewakan lah, revisi2nya juga diselesaikan dengan baik dan dengan sesuai konsep ane dari awal\nSorry ya bro kl respon ane agak telat\n-Rio', '', '2017-04-27', '2016-04-27 07:00:00', '', 1, 'sakura-kita', 1, NULL, NULL, NULL, '2016-04-25 20:00:00', '2020-11-07 08:03:42', NULL),
(20, 'PORTFOLIO000020', 1, 18, '', '', 1, 'Universitas Maju Jaya', NULL, 'Aplikasi Pengisian KRS Online yang dapat di isi oleh mahasiswa Universitas Maju Jaya tanpa harus datang ke kampus dan dapat dicetak KRS nya.\nDengan adanya aplikasi KRS Online, mahasiswa lebih mudah mengisi KRS mereka.', '', 500000, 'logo-universitas-maju-jaya.webp', 'universitas-maju-jaya-1.webp', 'universitas-maju-jaya-2.webp', 'universitas-maju-jaya-3.webp', 'universitas-maju-jaya-4.webp', 'universitas-maju-jaya-5.webp', 'Terima kasih ya andri , yang sudah membantu saya membuat program aplikasi sistem informasi kampus KRS.\n\nAplikasinya sesuai dengan request permintaan saya melalui use case yang saya berikan.\nSemangat terus andri dan usaha DIW nya.', '', NULL, '2016-05-31 07:00:00', '', 0, 'universitas-maju-jaya', 1, NULL, NULL, NULL, '2016-05-29 20:00:00', '2020-11-07 08:03:42', NULL),
(21, 'PORTFOLIO000021', 1, 20, '', '', 1, 'PT Jalur Sejuk', NULL, 'We take this opportunity to introduce you our company, PT. JALUR SEJUK, a wholly -owned national company established mainly to serve the development of manufacturing insulation panels for Cold rooms & Telecommunication Shelter Cabin, stocking in refrigeration parts, designing walk- in industrial and commercial cold store warehouses. The company is willing to co work with others in the industries with the aim to supply and to give the best service to end users, telecommunication sectors, food traders, restaurants, hotels, food distribution centers, hospitals, on land and marine cold storage systems.\n\nOur factory is located in the industrial estate of Tangerang, 30 km of Central Jakarta, and has and overall staff of 60 people. We are capable of producing a single length panel of up to 12 m, with thickness of 50 mm up to 200 mm in 25 mm increment. The insulation is injected with the latest high-pressure injection capacity machine using environmentally friendly raw materials.\n\nPT. Jalur Sejuk is supported by professional manpower competent in their disciplines together with years of practical experience on insulation panelâ€™s production and sales of refrigeration equipmentâ€™s.\n\nWe offer a full range of profesional service in :\nâ€¢ Manufacturing polyurethane insulation panels.\nâ€¢ Manufacturing Kitchen and Stainless Steel Fabrication.\nâ€¢ Manufacturing (Custom made) Ice Block Plant.\nâ€¢ Stockiest of Refrigeration & Air conditioning spare parts, Tools, Condensing Unit, etc.\nSupervision and inspection of cold store, freezer, and associated equipment\nâ€¢ Commissioning of complete cold store, freezer and related refrigeration plants.\nâ€¢ Commisioning of ME & CKD Shelter for telecomunication application.', '', 1500000, 'logo-pt-jalur-sejuk.webp', 'pt-jalur-sejuk-1.webp', 'pt-jalur-sejuk-2.webp', 'pt-jalur-sejuk-3.webp', 'pt-jalur-sejuk-4.webp', 'pt-jalur-sejuk-5.webp', 'Puji Tuhan bgt..\nThanks 