(22, 'PORTFOLIO000022', 1, 19, '', '', 1, 'PT Daliny Guna Usaha', NULL, 'PT. Daliny Guna Usaha adalah salah satu perusahaan yang berkembang di bidang distributor-retail produk-produk souvenir, hadiah, stationery dan tas anak yang cukup terkemuka di daerah Jakarta. Didirikan pada tahun 1987 oleh Ibu Lily selaku Owner dan dikembangkan oleh Bapak Erwin Kusnadi selaku Direktur Operasional. PT. Daliny Guna Usaha mempunyai 3 gudang yang tersebar di daerah Jabotabek dan memiliki 2 ruko yang digunakan sebagai kantor  2 unit Ruko yang digunakan sebagai kantor yang terletak di Jl. Raya Kebayoran Lama No. 39 B-C, Jakarta 12210 dengan memperkerjakan sekitar 26 karyawan yang berperan pada bagian FAD, Marketing, Personalia, 22 orang pada bagian gudang dan memiliki 150 karyawan yang diperkerjakan sebagai pramuniaga (SPG).\n\nSeluruh barang yang di jual oleh PT. Daliny Guna Usahanya mendapatkan lisensi dari masing-masing vendor. Sejauh ini PT. Daliny Guna Usaha sudah mengantongi 20 lisensi diantaranya Sanrio, Minnion, Angry Bird, Disney Tsum Tsum dan masih banyak lagi.\n\nPT. Daliny Guna Usaha memiliki 6 Toko yang berada di mal besar daerah Jakarta yang dinamakan Familia dan Sanrio Gift gate. PT. Daliny Guna Usaha juga memasok ke department store terkemuka di seluruh Indonesia seperti Matahari, Centro, Gramedia dan masih banyak lagi yang jumlahnya kurang lebih 150 counter dan dengan pengiriman barang dengan rata-rata nominal bruto kurang lebih Rp 35.000.000,-  per hari.', '', 1500000, 'logo-pt-daliny-guna-usaha.webp', 'pt-daliny-guna-usaha-1.webp', 'pt-daliny-guna-usaha-2.webp', 'pt-daliny-guna-usaha-3.webp', 'pt-daliny-guna-usaha-4.webp', 'pt-daliny-guna-usaha-5.webp', 'Thanks ko atas pembuatan programnya\nSemuanya berjalan baik-baik saja', '', NULL, '2016-06-07 07:00:00', '', 0, 'pt-daliny-guna-usaha', 1, NULL, NULL, NULL, '2016-06-05 20:00:00', '2020-11-07 08:03:42', NULL),
(23, 'PORTFOLIO000023', 1, 21, '', '', 1, 'Prediksi Angka', NULL, 'Prediksi Angka dengan memasukan 6 data berupa x1, x2, dan y, lalu di proses mulai dari menjumlahnya nilai Y, matriks 6x6, proses TETA, dan hasil new_c1, new_c2,new_c3, new_c4, new_a1, new_a2, new_a3, new_a4. Setelah di kalkulasi, menginput nilai new x1, x2, dan di proses untuk data new y.', '', 2000000, 'logo-prediksi-angka.webp', 'prediksi-angka-1.webp', 'prediksi-angka-2.webp', 'prediksi-angka-3.webp', 'prediksi-angka-4.webp', 'prediksi-angka-5.webp', 'makasih gan atas bantuannya..\nrespone jelas.. recomended nih \n\ncendol send', 'https://fjb.kaskus.co.id/show_post/576cba9762088166788b4575/4/', NULL, '2016-06-11 07:00:00', '', 1, 'prediksi-angka', 1, NULL, NULL, NULL, '2016-06-09 20:00:00', '2020-11-07 08:03:42', NULL),
