(26, 'PORTFOLIO000026', 9, 14, 'jomd3245', 'DevelopInspireWebsite2016!', 1, 'Jomblo Run', NULL, 'Latar Belakang\nAcara Jomblo Run ini dibuat untuk memberikan kegembiraan kepada masyarakat dalam berolahraga. Jomblo Run adalah sebuah acara lari santai dimana para peserta ikut di dalamnya mempunyai status single atau lebih dikenal dengan sebutan jomblo. Tidak ada batasan usia dalam mengikuti acara lari santai Jomblo Run.\n\nBagi yang sudah memiliki pasangan tetap diperbolehkan ikut tetapi, baju yang digunakan bagi orang-orang yang sudah memiliki pasangan akan berbeda dari para peserta lari yang masih single atau jomblo. Dan bagi yang sudah memiliki pasangan, tidak dapat mengikuti games-games pada acara lari santai Jomblo Run. Tetapi, akan ada hadiah khusus bagi para peserta yang sudah memiliki.\n\nPada sisi lain, acara Jomblo Run ini juga mempunyai tujuan untuk menambah rasa keakraban dan solidaritas sesama masyarakat atau warga. Dan juga menjadi ajang temu jodoh bagi muda-mudi yang masih single atau jomblo. Pada akhir acara Jomblo Run akan ada Disc Jocket (DJ) Show sebagai penutup selesainya acara.\n\nTidak hanya untuk sekedar kesenangan semata, acara Jomblo Run juga dibuat untuk melakukan misi sosial yaitu, untuk membantu anak-anak penderita kanker yang berasal dari keluarga Pra-Sejahtera di Indonesia.\n\nMaksud dan Tujuan\nAcara ini dibuat untuk mempereat rasa keakraban dan juga solidaritas sesama masyarakat atau warga dimana acara Jomblo Run ini dilaksanakan.\nMenjadi ajang perkenalan dan temu jodoh antara muda-mudi yang masih single atau jomblo.\nMengajak seluruh elemen masyarakat terutama para kawula muda untuk berolahraga di tengah padatnya aktivitas sehari-hari.\nSebagian hasil pendapatan dari acara Jomblo Run akan didonasikan untuk membantu anak-anak penderita kanker.', 'https://www.jomblorun.id', 0, 'logo-jomblo-run.webp', 'jomblo-run-1.webp', 'jomblo-run-2.webp', 'jomblo-run-3.webp', 'jomblo-run-4.webp', 'jomblo-run-5.webp', 'Testimoni DIW :\nWebsite Jomblo Run TOP abisss !\nDIW mampu memberikan sentuhan-sentuhan warna pada website sesuai dengan projek yang akan dijalankan..\n-Kenny-', '', '2017-01-25', '2016-07-21 00:00:00', '', 1, 'jomblo-run', 1, NULL, NULL, NULL, '2016-07-19 13:00:00', '2020-11-07 08:03:42', NULL),
