(30, 'PORTFOLIO000030', 1, 18, '', '', 1, 'Dasana Indah Tangerang', NULL, 'Warga Perumahan Dasana Indah, khususnya RT 002 RW 015 adalah warga yang menetap di wilayah RT 002 yang diresmikan, diputuskan dan ditetapkan oleh Kepala Kelurahan Bojong Nangka, Kecamatan Kelapa Dua Tangerang yang di pimpin oleh H. Yayat Rohiman.\n\nKedudukan dan Status Warga RT 002/015 adalah warga yang menetap dan tinggal di wilayah RT 002/015, baik dirumah milik sendiri atau pun kontrak.\n\nAdapun Kebijakan Pindahan dari RT 002/015 sebagai berikut:\n1. Warga yang pindah keluar wilayah RT 002 diwajibkan melapor ke pengurus RT 002 dan membuat surat pindah dari RT 002 RW 015\n2. Warga yang pindah keluar wilayah RT 002, bukan lagi warga RT 015.\n3. Warga yang masih memiliki kartu tanda penduduk RT 002, tetapi tidak lagi tinggal di wilayah RT 002 bukan warga RT 002.\n4. Dalam hal-hal tertentu ketua RT berhak mengambil kebijakan.', '', 2500000, 'logo-dasana-indah-tangerang.webp', 'dasana-indah-tangerang-1.webp', 'dasana-indah-tangerang-2.webp', 'dasana-indah-tangerang-3.webp', 'dasana-indah-tangerang-4.webp', 'dasana-indah-tangerang-5.webp', 'Thanks ya andri, berkat u gw jadi selesai penulisannya dan di bantu2 juga ampe softcover plus CD nya. Programnya juga sesuai ama yang gw mau dan dosen juga. Sukses terus usaha u dri.', '', NULL, '2016-09-28 05:07:00', '', 0, 'dasana-indah-tangerang', 1, NULL, NULL, NULL, '2016-09-26 18:07:00', '2020-11-07 08:03:42', NULL),
(31, 'PORTFOLIO000031', 14, 32, 'apod4136', 'Andrisunardi25!', 1, 'Studiolife Music Studio', NULL, 'Studiolife kami dirikan pada tahun 2011 dan beroperasi hingga saat ini. Fokus utama kami adalah untuk menyediakan ruangan serta alat-alat musik yang berkualitas agar anda para pemusik dapat menyalurkan bakat dan hobi anda dengan leluasa di studio kami. Kami juga berkomitmen untuk memberikan pelayanan yang optimal kepada anda, para pelanggan setia kami.', 'http://www.studiolife.web.id', 2200000, 'logo-studiolife-music-studio.webp', 'studiolife-music-studio-1.webp', 'studiolife-music-studio-2.webp', 'studiolife-music-studio-3.webp', 'studiolife-music-studio-4.webp', 'studiolife-music-studio-5.webp', 'Gw ga mau banyak omong, ga mau banyak kata2, cuma 1 kata yang pantes setelah transaksi bikin web sama bro Andri Sunardi.. yaitu P-U-A-S!!!\n\nGimana ga puas, web pesenan sesuai request, gw maunya kyak gimana, dy bikin persis kyak yg gw mau..\n\nGa ribet, ga banyak neko2, tau2 web gw udah kelar aje.. bhahahaha..\nSoal harga really-really-really worth it setiap sen nya..\n\nPkoknya super sekali lah bro Andri Sunardi! Thanks berat broo...\n\n(nb: sering2 ya bikinin gw nutrisari kalo gw maen ksana.. wkwkwk)\n\nSukses terus broo.. DIW really inspired me!\n\n<a draggable=\"false\" href=\"https://www.facebook.com/diw.co.idd/posts/1190029421044597\" target=\"_blank\">Facebook Comment</a>\n\n<a draggable=\"false\" href=\"https://www.facebook.com/frostocktwo/posts/1144099332309189\" target=\"_blank\">Facebook Review</a>', 'https://www.facebook.com/frostocktwo/posts/1144099332309189', '2017-12-24', '2016-09-29 00:00:00', '', 1, 'studiolife-music-studio', 1, NULL, NULL, NULL, '2016-09-27 13:00:00', '2020-11-07 08:03:42', NULL),
(32, 'PORTFOLIO000032', 1, 33, '', '', 1, 'PT Cometa Can', NULL, '<b>PT Cometa Can</b>\nCometa Can adalah produsen kemasan kaleng yang biasa digunakan untuk general product dan food product (processed food dan dry food). Kemasan kaleng dibuat dalam berbagai bentuk dan ukuran baik polos maupun dicetak dengan aneka ragam warna dan didisain secara kreatif dan inovatif sehingga memberikan nilai jual yang tinggi terhadap produk yang dikemas.\n\n<b>Latar Belakang</b>\nPara pendiri Cometa Can mengawali usahanya dibidang perdagangan umum dan export-import pada tahun 1953. Dalam perkembangan usahanya, pada tahun 1965 salah satu divisi dari Cometa memantapkan diri menjadi pemasok tinplate (bahan baku kaleng) terbesar nasional pada saat itu. Kesuksesan ini menjadi titik tolak diversifikasi usaha perusahaan yang mendapatkan status PMDN pada tahun 1973 dan pada tahun 1975 menjadi PT. Cometa Can Corporation ( Cometa Can ).\n\nPada awalnya Cometa Can hanya berkonsentrasi pada produksi general can. Memasuki era tahun 80-an Cometa Can mulai meluaskan produksinya ke produk processed food can dan Dry food can sampai saat ini.\n\nBerkat dukungan serta kepercayaan dari para pelanggan selama lebih dari 3 dekade, Cometa Can telah menjelma menjadi salah satu produsen terbesar dalam industri kemasan kaleng nasional.', '', 2300000, 'logo-pt-cometa-can.webp', 'pt-cometa-can-1.webp', 'pt-cometa-can-2.webp', 'pt-cometa-can-3.webp', 'pt-cometa-can-4.webp', 'pt-cometa-can-5.webp', 'sukses terus untuk DIW, semoga ke depan bisa lebih maju, lebih berkembang menjadi mitra bisnis yang handal dalam bidang jasa pembuatan website.\nThanks for DIW Website', '', NULL, '2016-10-12 00:00:00', '', 0, 'pt-cometa-can', 1, NULL, NULL, NULL, '2016-10-10 13:00:00', '2020-11-07 08:03:42', NULL),
(33, 'PORTFOLIO000033', 1, 47, 'smas8126', 'DevelopInspireWebsite2017!', 1, 'SMA Santa Maria Della Strada', NULL, 'SMA Santa Maria Della Strada adalah sekolah Katolik milik Paroki Santo Alfonsus Rodrigues di bawah naungan Yayasan Pendidikan Umum Santo Lukas. Dan mulai beroperasi pada tahun 2000/2001 Terakreditasi â€œAâ€.\n\nLokasi SMA Santa Maria Della Strada Jakarta berada di Jalan Pademangan I Gang 7 Nomor 18 jakarta Utara. Secara umum kondisi ekonomi siswa SMA Santa Maria Della Strada dipengaruhi oleh kondisi sosial sehingga terdapat disparitas yang nyata.\n\nVISI\nMENJADI MANUSIA YANG BERPRESTASI, INOVATIF,\nDAN \nMANDIRI BERDASARKAN CINTA KASIH\n\nMISI\n1. Meningkatkan prestasi dalam bidang akademik dan non-akedemik.\n2. Mengembangkan potensi siswa.\n3. Meningkatkan kemandiran dalam belajar dan bertindak.\n4. Menumbuhkembangkan kepedulian.', 'http://www.smasantamariadellastrada.com', 5000000, 'logo-sma-santa-maria-della-strada.webp', 'sma-santa-maria-della-strada-1.webp', 'sma-santa-maria-della-strada-2.webp', 'sma-santa-maria-della-strada-3.webp', 'sma-santa-maria-della-strada-4.webp', 'sma-santa-maria-della-strada-5.webp', 'Makasih ya ko udah dibuatn programnya basis website kita. Nanti kalau ada project skripsi lagi, pasti saya kabarin. Thank you ko.', '', '2018-01-25', '2016-10-21 00:00:00', '', 0, 'sma-santa-maria-della-strada', 1, NULL, NULL, NULL, '2016-10-19 13:00:00', '2020-11-07 08:03:42', NULL),
(34, 'PORTFOLIO000034', 11, 34, 'tunm1387', 'DevelopInspireWebsite2016!', 1, 'Tungkal Punye', NULL, 'Tungkal Punye adalah Perusahaan yang bergerak di bidang Jasa Penyewaan Papan Bunga, Kipas Angin Blower, Lampu Hias, LED, Lampu Sorot, Proyektor, Mesin Genset 8.000watt, baju khas Tungkal, dan menyediakan berbagai macam sovenir khas tungkal.\n\nTungkal Punye\nMr FL Production\n\nSenin - Sabtu: 08.00â€“12.00, Minggu Libur\nJalan Panglina H. Saman RT 17. No. 029, Kualatungkal, Jambi, Indonesia\n\nTelepon: 08 5266 818 395\nGmail: andryfaisalyfm@gmai.com\nEmail: tungkalpunye@gmail.com\nWebsite: www.tungkalpunye.com\n\nFacebook: Kaos Tungkal Punye\nFacebook: Tungkal Florist\nInstagram: tungkal_kaos\nInstagram: tungkal_punye', 'https://www.tungkalpunye.com', 2500000, 'logo-tungkal-punye.webp', 'tungkal-punye-1.webp', 'tungkal-punye-2.webp', 'tungkal-punye-3.webp', 'tungkal-punye-4.webp', 'tungkal-punye-5.webp', 'Ane bingung gan ngisi testimoninya. Soalnya saya banyak permintaan dari agan. Dari background, pengaturan warna, ukuran, dan masih banyak deh gan. Dan juga sebelum deal, agan sabar ngadepin pertanyaan2 ane yang mungkin ane kurang paham di bidang website.\n\nPelayanan agan Andri ini kalau begini terus, pasti banyak yang beli jasa di ente gan. Salut ane gan sama ente punya usaha jasa website. Thank you dah bozz atas kerjasamanya.. -Tungkal Punye', 'https://www.facebook.com/kaosdistro.tungkalpunye/posts/219977371758533', '2017-10-31', '2016-10-30 00:59:00', '', 1, 'tungkal-punye', 1, NULL, NULL, NULL, '2016-10-28 13:59:00', '2020-11-07 08:03:42', NULL),
