(37, 'PORTFOLIO000037', 1, 39, '', '', 1, 'PT Hero Supermarket Tbk', NULL, 'HERO Group adalah pelopor di ritel modern yang memiliki banyak toko di Indonesia. HERO Group merupakan perusahaan ritel modern pertama di Indonesia, didirikan pada tahun 1971 oleh almarhum Muhammad Saleh Kurnia di Jl. Falatehan, Jakarta.\n\nHERO Group membuka toko pertamanya di Jakarta pada tahun 1971 dan telah berkembang menjadi salah satu operator terkemuka di Indonesia untuk supermarket, hipermarket, toko kesehatan dan kecantikan, dan toko perabot rumah tangga, mengoperasikan lima merek toko dengan total 465 toko di seluruh Indonesia pada 30 September 2016. Perusahaan telah tercatat di Bursa Efek Indonesia sejak tahun 1989 (Kode Saham: HERO).', '', 2000000, 'logo-pt-hero-supermarket-tbk.webp', 'pt-hero-supermarket-tbk-1.webp', 'pt-hero-supermarket-tbk-2.webp', 'pt-hero-supermarket-tbk-3.webp', 'pt-hero-supermarket-tbk-4.webp', 'pt-hero-supermarket-tbk-5.webp', 'Program yang ko2 buat udah bagus cuma rada berat gara2 data dari saya 5ribu data, jadinya rada lag. But overall oke ko. Terima kasih.', '', NULL, '2016-11-03 00:00:00', '', 0, 'pt-hero-supermarket-tbk', 1, NULL, NULL, NULL, '2016-11-01 13:00:00', '2020-11-07 08:03:42', NULL),
(38, 'PORTFOLIO000038', 2, 24, 'brightclub', '4dm1n-br1ght', 1, 'BrightClub.biz', NULL, 'Bright Club Stay Connected!!\n\nBisnis yang bisa dikerjakan dimana saja \nJoin bareng Komunitas kami yukkk !!!\n\nOriflame adalah sebuah perusahaan kecantikan terkemuka dengan sistem penjualan langsung. Hadir di lebih dari 60 negara, dan merupakan perusahaan yang berasal dari Swedia dengan kantor pusat di Swiss. Kami menawarkan produk kecantikan berkualitas tinggi - berikut kesempatan unik untuk bergabung menjadi konsultan kami dan memulai bisnis Anda sendiri. ', 'http://brightclub.biz', 1000000, 'logo-brightclub-biz.webp', 'brightclub-biz-1.webp', 'brightclub-biz-2.webp', 'brightclub-biz-3.webp', 'brightclub-biz-4.webp', 'brightclub-biz-5.webp', 'Sudah 2x saya pakai jasa Andri Sunardi untuk membuatkan website\nDan hasilnya sesuai dengan konsep yang diberikan.\nBahkan yang saya bingung, di bantu dengan hasil yang maksimal\nSukses terus, Develop Inspire Website', '', '2017-11-15', '2016-11-15 00:00:00', '', 1, 'brightclub-biz', 1, NULL, NULL, NULL, '2016-11-13 13:00:00', '2020-11-07 08:03:42', NULL),
(39, 'PORTFOLIO000039', 11, 34, 'bary1623', 'DevelopInspireWebsite2016!', 1, 'Barang Bekas Tungkal', NULL, 'Barang Bekas Tungkal adalah media situs website yang menyediakan bagi para penjual untuk menjual barang bekas dengan cara memasang iklan agar dapat terjual dengan cepat dan mudah sekaligus tempat mencari beragam produk barang bekas dan baru yang berkualitas bagi para pembeli.', 'https://www.barangbekastungkal.com', 2500000, 'logo-barang-bekas-tungkal.webp', 'barang-bekas-tungkal-1.webp', 'barang-bekas-tungkal-2.webp', 'barang-bekas-tungkal-3.webp', 'barang-bekas-tungkal-4.webp', 'barang-bekas-tungkal-5.webp', NULL, '', '2017-12-18', '2016-11-25 23:05:00', '', 1, 'barang-bekas-tungkal', 1, NULL, NULL, NULL, '2016-11-24 12:05:00', '2020-11-07 08:03:42', NULL);
