(40, 'PORTFOLIO000040', 2, 41, '', '', 2, 'PT Sanggar Sarana Baja', NULL, '<b>Welcome to PT Sanggar Sarana Baja</b>\nPT Sanggar Sarana Baja (SSB) is a company engaged in the manufacture of equipment for oil & Gas, mining, power generation, transport equipment, re-manufacture of heavy equipment component, and provides machining & welding services on-site. These days, the company has diversified and operates Industrial Transport Equipment (ITE) business and Service business, from 3 (three) main factories and numerous mine site workshop.', 'http://www.ptssb.co.id', 2300000, 'logo-pt-sanggar-sarana-baja.webp', 'pt-sanggar-sarana-baja-1.webp', 'pt-sanggar-sarana-baja-2.webp', 'pt-sanggar-sarana-baja-3.webp', 'pt-sanggar-sarana-baja-4.webp', 'pt-sanggar-sarana-baja-5.webp', 'Gan andri, makasih ya udah bantu2 revisi sampai finish web SSB nya. Maaf kalau banyak request ini itu.', '', '2017-11-26', '2016-11-26 19:57:00', '', 1, 'pt-sanggar-sarana-baja', 1, NULL, NULL, NULL, '2016-11-25 08:57:00', '2020-11-07 08:03:42', NULL),
(41, 'PORTFOLIO000041', 1, 42, '', '', 1, 'PT Global Nuasa Wisata', NULL, 'PT. Global Nuasa Wisata (sumber dari PT. Global Nuasa Wisata) dengan merek dagang Global Network Tours & Travel adalah sebuah perusahaan yan bergerak di bidang jasa pariwisata. Berdiri pada tanggal 20 Desember 2012. Global Network Tours & Travel terbilang baru, tetapi dalam waktu beberapa bulan, Global Network Tours & Travel sudah mampu memberangkatkan lebih dari 386 peserta dengan tujuan dalam dan luar negeri. Target kami 1 tahun kedepan ingin memberangkatkan 1.000 peserta dengan tujuan dalam dan luar negeri, karena Global Network Tours & Travel ingin membangun rekam jejak agar dikenal baik dan dekat dengan Anda semua.', '', 6800000, 'logo-pt-global-nuasa-wisata.webp', 'pt-global-nuasa-wisata-1.webp', 'pt-global-nuasa-wisata-2.webp', 'pt-global-nuasa-wisata-3.webp', 'pt-global-nuasa-wisata-4.webp', 'pt-global-nuasa-wisata-5.webp', 'Saya sudah menggunakan layanan pembuatan web di DIW.. Bagi yang mau bikin web lgsg di DIW aja.. Di bantu dr awal, sampe beres dan bakal sampe ngerti.. Pelayanannya jg ramah.. Thx DIW..', 'https://www.facebook.com/calvin.lie.94/posts/10208615256046530', NULL, '2016-12-02 08:02:00', '', 0, 'pt-global-nuasa-wisata', 1, NULL, NULL, NULL, '2016-11-30 21:02:00', '2020-11-07 08:03:42', NULL),
(42, 'PORTFOLIO000042', 11, 45, 'wadw2883', 'DevelopInspireWebsite2016!', 1, 'Wadong Tas', NULL, 'Wadong Tas adalah Industri Tas untuk semua model. Menerima pesanan dan grosiran Tas Wanita, Tas Rangsel, Tas Kantor, Pelampung, dan Dompet. Produk Kami hanya di kerjakan sendiri dan kerja sama oleh tukang-tukang karib kami. Wadong Tas juga siap untuk merevisi Tas seperti Pola, Ukuran, Jahitan, sesuai yang anda pesan. Kami hanya menampung dan produksi sesuai kesepakatan yang anda telah pesan.', 'http://www.wadongtas.com', 700000, 'logo-wadong-tas.webp', 'wadong-tas-1.webp', 'wadong-tas-2.webp', 'wadong-tas-3.webp', 'wadong-tas-4.webp', 'wadong-tas-5.webp', 'senior nya bkin web engko andri paten bner\n\nHebat ngkoo grup ane jual barang online brkulitas sudah rame ..tiap detik bnyk yg positing. Salam sukses ngko\n\nNgkoo memang salluuut thnk yuuo', 'https://www.facebook.com/ady.Restu99/posts/247770938993582', '2017-12-18', '2016-12-19 00:00:00', '', 1, 'wadong-tas', 1, NULL, NULL, NULL, '2016-12-17 13:00:00', '2020-11-07 08:03:42', NULL),
(43, 'PORTFOLIO000043', 2, 25, 'k6467033', 'hbdgadai00000', 1, 'PT HBD Gadai Nusantara', NULL, 'PT HBD GADAI NUSANTARA - GADAI EMAS DAN PERMATA PT HBD Gadai Nusantara atau yang lebih di kenal dengan HBD Gadai adalah sebuah perusahaan pergadaian swasta yang berdiri pada bulan maret 2016 yang telah mendapatkan izin usaha pergadaian dan di awasi oleh Otoritas Jasa Keuangan (OJK) dengan nomor KEP - 100/D.05/2016.<br><br>PT HBD Gadai Nusantara turut berkontribusi bagi perkenonomian di Indonesia, khususnya dalam penyedian layanan keuangan melalui penyaluran dana pinjaman kepada masyarakat dengan jaminan berupa Logam Mulia Emas, Perhiasan Emas, Permata, dan lain-lain. PT HBD Gadai Nusantara merupakan merek dagang yang sudah terdaftar pada Hak Kekayaan Intelektual (HAKI) yang telah dilindungi oleh undang-undang.<br><br>PT HBD Gadai Nusantara berkantor pusat di Jl. Matraman Raya No. 212 Jakarta Timur 13320 PT HBD Gadai Nusantara (HBD Gadai) merupakan pergadaian swasta yang telah mendapatkan izin usaha pergadaian dari Otoritas Jasa Keuangan (OJK) dengan nomor KEP - 100/D.05/2016. HBD Gadai merupakan merek dagang yang sudah terdaftar pada Hak Kekayaan Intelektual (HAKI) yang telah dilindungi oleh undang-undang.', 'http://www.hbdgadai.co.id', 10000000, 'logo-pt-hbd-gadai-nusantara.webp', 'pt-hbd-gadai-nusantara-1.webp', 'pt-hbd-gadai-nusantara-2.webp', 'pt-hbd-gadai-nusantara-3.webp', 'pt-hbd-gadai-nusantara-4.webp', 'pt-hbd-gadai-nusantara-5.webp', 'Mari buat website anda menggunakan jasa DIW dengan DIW di jamin website anda menarik, eye catching, di jamin memuaskan...<br>Anda Puas DIW pun puas... 👍👍👍&nbsp;', 'https://www.facebook.com/samuel.samy1/posts/1456703931007606', '2019-09-01', '2016-12-22 00:00:00', '', 1, 'pt-hbd-gadai-nusantara', 1, NULL, NULL, NULL, '2016-12-20 13:00:00', '2020-11-07 08:03:42', NULL),
(44, 'PORTFOLIO000044', 1, 48, '', '', 1, 'Elizabeth Helen', NULL, 'Elizabeth Helen diproduksi oleh Saudi Perfume & Cosmetics Company (SPCCL) yang berbasis di Jeddah, Arab Saudi. Merupakan perusahaan kecantikan/kosmetik terbesar di seluruh Timur Tengah. Didirikan pada tahun 1982, dengan fasilitas produksi yang terintegrasi untuk parfum dan kosmetik.\n\nPerusahaan Saudi Parfum & Kosmetik juga memproduksi nama-nama merek terkenal lainnya seperti \"Elizabeth Helen, J.Casanova\", \"J.Casanova Biru\", \"Beethoven\" dan \"Rembrandt\" di wilayah Timur Tengah, didukung oleh pilihan \"Plaisir\" dan \"Pandora\" sebagai dasar wewangian yang diterbitkan oleh German H & R Parfum Genealogi.\n\nKami juga didukung oleh produk lainnya yang berbeda dari anak perusahaan Mahmood Saeed Grup yang meningkatkan barisan jajaran produk kami. Kami bekerja ekstra untuk memberikan jaminan dan kepuasan kepada Anda, bukan hanya parfum atau kosmetik sebagai produk yang berkualitas yang membuat impian indah Anda menjadi kenyataan, tetapi selain itu kami memberikan produk lainnya untuk saling melengkapi untuk menghasilkan hasil akhir yang indah untuk setiap momen berharga Anda.\n\nElizabeth Helen merupakan produk kosmetik yang berkualitas premium, dengan koleksi kosmetik Elizabeth Helen maka setiap wanita dapat menambahkan elemen ekstra keindahan, kepercayaan untuk mencerminkan keindahan wanita dalam bentuknya yang murni dan bercahaya', '', 500000, 'logo-elizabeth-helen.webp', 'elizabeth-helen-1.webp', 'elizabeth-helen-2.webp', 'elizabeth-helen-3.webp', 'elizabeth-helen-4.webp', 'elizabeth-helen-5.webp', 'Nahhh hehe, sesuai sama maksud gw kok\n\nOkay thanks ya brooohh bantuannya hehehe!', '', NULL, '2017-01-10 00:00:00', '', 1, 'elizabeth-helen', 1, NULL, NULL, NULL, '2017-01-08 13:00:00', '2020-11-07 08:03:42', NULL),
(45, 'PORTFOLIO000045', 8, 23, 'mija6632', 'DevelopInspireWebsite2016!', 1, 'Dealer Honda Jakarta', NULL, 'Dealer Honda Jakarta adalah Sebuah Dealer Authorized Honda yang siap melayani Penjualan, Sales Dan Service dengan kualitas dan suku cadang terbaik untuk memberikan anda kepuasan dari pelayanan kami. Kami siap melayani anda 24 jam untuk kebutuhan keluarga Anda. Segera Hubungi Kami dan kunjungi website kami di dealerhondajakarta.id\n\nDealer Honda Jakarta, Harga Mobil Honda, Paket Kredit Honda, Promo Honda Jakarta, Dealer Resmi Honda Jakarta, Agen Honda Jakarta, Harga Honda Jakarta, Harga Terbaru Honda, Honda Jakarta, Daftar Harga Honda, Price List Honda, Erick Favian, Dealer Authorized Honda, Honda Dealer Jakarta, Harga Promo Honda, Showroom Honda Jakarta.\n\nKontak Kami\nErick Favian\nTelkomsel : 0812 1006 6004 (Whatsapp)\nBBM: D8114E0A\nXL : 0878 8989 7981\nerick.faviano@gmail.com\n\nRekening Bank Transfer\nPembayaran Giro / Transfer Via Rekening\nPT. Mitrausaha Gentaniaga\nBCA Cabang Lideteves No. 645 005 1771\n\nLokasi\nJalan Lingkar Luar Barat Puri Kembangan,\nKembangan Utara, Kembangan, Kota Jakarta Barat,\nDKI Jakarta - PO Box 11610', 'https://www.dealerhondajakarta.id', 550000, 'logo-dealer-honda-jakarta.webp', 'dealer-honda-jakarta-1.webp', 'dealer-honda-jakarta-2.webp', 'dealer-honda-jakarta-3.webp', 'dealer-honda-jakarta-4.webp', 'dealer-honda-jakarta-5.webp', 'Thanks to Andri !! PUAS BANGET DEH pakai jasa ini !! Murmer proses awal sampai akhir selalu di support abis !!! MANTAP ! Saya erick , sudah memakai jasa ini 2 kali ! Dan mantap untuk tanggung jawabnya !! Thanks DIW !!', 'https://www.facebook.com/fvnzmcm/posts/969143236552004', '2018-02-08', '2017-02-05 20:40:00', '', 1, 'dealer-honda-jakarta', 1, NULL, NULL, NULL, '2017-02-04 09:40:00', '2020-11-07 08:03:42', NULL),
