(50, 'PORTFOLIO000050', 2, 384, 'neon1439', 'qo9KYldkaIyMrWXSwE4z', 1, 'Neos Car Coating', NULL, 'Neos Car Coating - We Make Up Your Car. Salon Mobil Tentang Kami NEOS dimulai bulan April 2010, dengan menyewa di Parkiran P1 ( indoor ) WTC Matahari Serpong Tangerang dan pada Juli 2010 kami membuka outlet NEOS yang kedua di Basement 1 TangCity Mall LATAR BELAKANG Latar Belakang NEOS membuka Usaha Salon Mobil ini karena kami melihat sering kali banyak orang kurang memahami bagaimana merawat mobilnya dengan baik dan benar, dimana mobil kita yang berharga mahal itu sangat penting untuk diberikan perawatan yang baik dan benar. Seperti halnya manusia yang perlu perawatan, maka mobil pun juga harus dirawat dari akibat negatif air hujan yang asam, yang dapat membentuk menjadi jamur dan debu-debu yang dapat menyebabkan baret-baret dan goresan halus pada cat badan mobil, serta berbagai partikel kecil yang dapat menyebabkan korosif. VISI DAN MISI Visi Misi usaha ini adalah Setiap customer pada Salon Kami mengerti akan pentingnya perawatan pada mobil yang kita miliki dan Motto kami adalah Memberikan Perawatan dan Pelayanan yang terbaik untuk Kepuasan Pelanggan. PROFIL USAHA Nama Merek Usaha ini adalah &acirc;&euro;&oelig; NEOS &acirc;&euro;&oelig; dalam bahasa Yunani artinya BARU, MUDA, FRESH / SEGAR. Sehingga Mobil yang dirawat ditempat kami senantiasa seperti Mobil baru, fresh dan berkilau.', 'https://www.neoscarcoating.com', 4498000, 'logo-neos-car-coating.webp', 'neos-car-coating-1.webp', 'neos-car-coating-2.webp', 'neos-car-coating-3.webp', 'neos-car-coating-4.webp', 'neos-car-coating-5.webp', NULL, NULL, '2019-06-05', '2017-02-28 13:35:00', 'Dari Florentina Melly Ratna Sari', 1, 'neos-car-coating', 1, NULL, NULL, NULL, '2017-02-27 02:35:00', '2021-03-13 08:27:13', NULL),
