(56, 'PORTFOLIO000056', 2, 35, 'sejy5596', 'DevelopInspireWebsite2017!', 1, 'Sejahtera Kaca & Aluminium', NULL, 'Sejahtera Aluminium - (SK) - Sejahtera Kaca & Aluminium\nToko Sejahtera Aluminium - (SK) - Sejahtera Kaca & Aluminium adalah toko kaca dan Aluminium yang menerima dan mengerjakan Kusen Aluminium - Pintu Aluminium - Pintu Expanda - Kasa Nyamuk - Etalase - Partisi Gipsum - Exterior Dan Interior.\n\nBagi anda yang masih bingung mencari yang berhubungan dengan kaca dan aluminium yang berkualitas dengan harga yang murah, anda dapat ke lokasi kami di Teluk Gong Jl. B No. 25 C Jakarta Utara dan (Toko) Taman Permata Indah 2 Blok K1 No. 9 Jakarta Utara.\n\nSerahkan kepada kami segala pekerjaan kaca dan aluminium anda kepada kami. Anda dapat memilih ratusan produk yang tersedia di toko kami.\n\nKami akan berusaha semaksimal mungkin untuk tidak mengecewakan para kosumen kami. Sehingga dengan cepat pula perusahan kami berkembang dari mulut ke mulut.\n\nKomitmen kami dalam bekerja adalah yang utama untuk kepuasan custumer kami, kami tidak pernah memberi janji tapi kami memberi bukti. untuk jangka waktu pekerjaan kami, kami selalu untuk berusaha tepat waktu.\n\nUntuk harga aluminium kami berusaha untuk memberikan harga yang paling murah dengan kualitas barang yang cukup bagus pula.\n\nPerusahaan kami menerima pemasangan Kusen Aluminium di seluruh jabodetabek dan luar kota.\n\nTerima kasih sudah mengunjungi situs kami.', 'https://www.sejahteraaluminium.com', 2473000, 'logo-sejahtera-kaca---aluminium.webp', 'sejahtera-kaca---aluminium-1.webp', 'sejahtera-kaca---aluminium-2.webp', 'sejahtera-kaca---aluminium-3.webp', 'sejahtera-kaca---aluminium-4.webp', 'sejahtera-kaca---aluminium-5.webp', 'Thank you ni bro Andri udah dibuatin websitenya sekalian di bantu promosiin web saya.\nUdah 2x pelayanan ama bro dan sangat memuaskan walaupun ane minta revisi dikit2..\n\nSukses selalu bro dan DIW nya!!', '', '2019-03-23', '2017-03-22 00:00:00', '', 1, 'sejahtera-kaca---aluminium', 1,