(65, 'PORTFOLIO000065', 7, 67, 'swap1563', 'DevelopInspireWebsite2017!', 1, 'SWAT GPKDI', NULL, 'S.W.A.T merupakan kepanjangan dari Service Worship Action Teaching, S.W.A.T sendiri ingin anak - anak muda pada jaman sekarang memiliki kasih yang dapat dibagikan kepada orang sekitar, membagi kebaikan dan jauh dari kegiatan negatif. Selama 4 (empat) tahun berdiri S.W.A.T telah berkembang memiliki kurang lebih 80 orang anggota, dengan anggota yang aktif sebesar 50 orang. Selama ini, S.W.A.T telah melakukan cukup banyak kegiatan, salah satu kegiatan sosial yang pernah diadakan yaitu mengikuti CFD (Car Free Day) di Jakarta. dalam acara tersebut S.W.A.T mengadakan permainan, kemudian membagikan berkat dalam bentuk makanan kepada orang sekitar, juga mengajarkan bahwa menyebarkan kebaikan dengan apa yang kita korbankan dapat berdampak positif pada orang sekitar.', 'https://www.swatgpkdi.com', 1973000, 'logo-swat-gpkdi.webp', 'swat-gpkdi-1.webp', 'swat-gpkdi-2.webp', 'swat-gpkdi-3.webp', 'swat-gpkdi-4.webp', 'swat-gpkdi-5.webp', NULL, NULL, '2019-05-11', '2017-05-11 00:00:00', NULL, 1, 'swat-gpkdi', 1, NULL, NULL, NULL, '2017-05-09 13:00:00', '2021-03-13 20:22:23', NULL),
