(67, 'PORTFOLIO000067', 1, 69, '', '', 1, 'Putra Mekar', NULL, 'Kami Percetakan CV PUTRA MEKAR (Creative Design - Printing - Advertising - Sablon)\n\nPada kesempatan ini perkenalkan kami PUTRA MEKAR adalah perusahaan yang bergerak dibidang jasa percetakan, ingin menawarkan kerjasama dalam pemenuhan kebutuhan percetakan perusahaan/usaha anda. Kami sangat terbuka untuk berkonfirmasi dan memberikan keterangan sesuai dengan kebutuhan percetakan perusahaan anda.\n\nBerikut ini kami tawarkan beberapa jenis penawaran yang kami sediakan untuk anda, seperti:\n\nNOTA, FAKTUR, KOP SURAT, AMPLOP, KARTU NAMA, SPANDUK, BALEHO, STICKER, BROSUR, X-BANNER, ROLL- UP BANNER, MINI BANNER, POSTER, MAP, KWITANSI, KALENDER, UNDANGAN, YASIN, ID CARD, NEON BOX, SERTIFIKAT, BUKU TAHUNAN, KARTU NAMA, KEMASAN MAKANAN, LABEL PRODUK, STEMPEL DLL.', '', 2000000, 'logo-putra-mekar.webp', 'putra-mekar-1.webp', 'putra-mekar-2.webp', 'putra-mekar-3.webp', 'putra-mekar-4.webp', 'putra-mekar-5.webp', '', '', NULL, '2017-05-28 00:00:00', '', 1, 'putra-mekar', 1, NULL, NULL, NULL, '2017-05-26 13:00:00', '2020-11-07 08:03:42', NULL),
(68, 'PORTFOLIO000068', 8, 71, 'toyx9921', 'DevelopInspireWebsite2017!', 1, 'Toyota Cipondoh', NULL, 'PT. Tunas Ridean. Tbk. Toyota Cipondoh merupakan situs personal Toyota Indonesia yang dibuat dan dipublikasikan untuk menginformasikan daftar harga dan spesifikasi mobil Toyota. HUBUNGI KAMI Nama : Alpian SMS Only : 0818 0870 0369 Whatsapp : 0813 1770 0369 Email : sales@toyota-cipondoh.com Alamat : Jl. Raya Merdeka No. 80, Cimone, Tangerang 15114 - Indonesia Website : www.toyota-cipondoh.com', 'https://www.toyota-cipondoh.com', 2300000, 'logo-toyota-cipondoh.webp', 'toyota-cipondoh-1.webp', 'toyota-cipondoh-2.webp', 'toyota-cipondoh-3.webp', 'toyota-cipondoh-4.webp', 'toyota-cipondoh-5.webp', 'Pelayanan jasaweb yang murah dan sangat rekomendasi 🖒 <br><br><a href=\"https://fjb.kaskus.co.id/show_post/5974a140c2cb17b2138b4584\">Kaskus</a>', 'https://www.facebook.com/alpian.hondaikmciledug/posts/900350700130696', '2018-06-21', '2017-06-21 19:22:00', '', 1, 'toyota-cipondoh', 1, NULL, NULL, NULL, '2017-06-20 08:22:00', '2020-11-07 08:03:42', NULL),
(69, 'PORTFOLIO000069', 3, 41, 'aniescol', '4yw4Qo1I7a', 1, 'Anies Collection', NULL, 'Part time tailor and cook - full time mother.\n\nI enjoy sewing and knitting very much so - that I made career out of it. Starting out as taking sewing classes while raising my children, and taking few orders from neighbours. After that, I start working with a company that make traditional malay clothes in bulk which help me learn how to cut and sew in a faster way.\n\nExperienced more than 20 years of tailoring different kind of design such as;\n\n- Baju Kurung\n- Baju Kurung Modem\n- Baju Kurung Pahang\n- Baju Kebaya\n- Jubah\n- Baju Melayu\n\nBring your own fabric and material to me and we\'ll start working on your baju right away!', 'http://www.anies-collection.com', 1500000, 'logo-anies-collection.webp', 'anies-collection-1.webp', 'anies-collection-2.webp', 'anies-collection-3.webp', 'anies-collection-4.webp', 'anies-collection-5.webp', '', '', '2018-08-11', '2017-08-11 11:08:00', '', 1, 'anies-collection', 1, NULL, NULL, NULL, '2017-08-10 00:08:00', '2020-11-07 08:03:42', NULL),
(70, 'PORTFOLIO000070', 12, 73, 'gend2962', 'DIW.CO.ID-DevelopInspireWebsite2017!', 1, 'Genius One', NULL, 'Genius One adalah sebuah perusahaan swasta yang bergerak di bidang bimbingan belajar private bertempat di gading serpong.\n\nPerusahaan ini pertama kali berdiri pada tahun 2011 dengan nama lama legacy private.\n\nPerusahaan kami bermotto \"Kepintaran dan nilai bagus murid adalah kewajiban kami\".\n\nKami menyediakan jasa private bagi semua murid di daerah tangerang dan jakarta, dengan guru-guru yang berpengalaman dan kompeten pastinya, kami telah banyak membantu murid-murid nasional plus ataupun international untuk menghadapi ujian - ujian maupun project - project.\n\n\"Kalau bisa pintar bersama kami, kenapa harus menunggu besok ?\"', 'https://www.geniusone.id', 2000000, 'logo-genius-one.webp', 'genius-one-1.webp', 'genius-one-2.webp', 'genius-one-3.webp', 'genius-one-4.webp', 'genius-one-5.webp', '', '', '2018-08-25', '2017-08-24 18:56:00', '', 1, 'genius-one', 1, NULL, NULL, NULL, '2017-08-23 07:56:00', '2020-11-07 08:03:42', NULL),
