(72, 'PORTFOLIO000072', 11, 75, 'manw7257', 'Developinspirewebsite2017!', 1, 'Manjakani Manza', NULL, 'Manjakani Manza adalah herbal 100% alami yang efektif mengencangkan dinding vagina, peningkat libido bagi wanita, pelumasan, dan membersihkan area Vagina secara alami.\n\nManfaat Manza\nMengencangkan Vagina\nManza bekerja dengan memberi tubuh anda apa yang dimilikinya sebelum menggunakan fitoestrogen(estrogen herbal), yang dengan mudah memperkuat otot dinding vagina Anda.\n\nMengembalikan Pelumasan dan Libido\nFormula Manza juga mengembalikan lapisan vagina bagian dalam yang bertanggung jawab atas pelumasan, memberikan nafsu seksual yang sehat.\n\nPembersihan Vagina\nBahan ramuan Manza mengandung zat anti oksidan dan antibakteri tingkat tinggi sehingga menjadi pembersih yang kuat!\n\nMeringankan Menopause\nMembantu menyeimbangkan tingkat estrogen, meringankan perubahan suasana hati, dan sulit tidur di malam hari.\n\n100% Herbal Alami\nTidak Ada Efek Samping\nBPOM Approves\nMUI Approves\nBest Seller\n\nBagaimana Cara Kerja Manza\nFitoestrogen (tanaman estrogen) membantu menciptakan sel baru untuk memperkuat otot dinding vagina.', 'https://www.manzaherbs.com', 3000000, 'logo-manjakani-manza.webp', 'manjakani-manza-1.webp', 'manjakani-manza-2.webp', 'manjakani-manza-3.webp', 'manjakani-manza-4.webp', 'manjakani-manza-5.webp', 'Good SERVICES n FRIENDLY', '', '2019-09-05', '2017-08-31 20:51:00', '', 1, 'manjakani-manza', 1, NULL, NULL, NULL, '2017-08-30 09:51:00', '2020-11-07 08:03:42', NULL),
(73, 'PORTFOLIO000073', 3, 38, 'indm9217', 'Indonut2017!', 1, 'Kangaroo', NULL, 'PT Surya Lestari Gemilang pertama berdiri tahun 1990 beralamat di Kota Batam, yang merupakan bagian dari Group Perusahaan &quot;SLG Group&quot; yang berkantor pusat di Singapura. Seiring berjalannya waktu, PT. Surya Lestari Gemilang mulai berkembang dan membuka kantor cabang di Kota Tangerang Selatan, Banten pada tahun 1998. Selain di Indonesia, SLG group juga memiliki kantor di Malaysia, Thailand dan Filipina. SLG Group memiliki Visi menjadi trend setter dalam industri makanan ringan dan Misi dari SLG Group adalah memberikan pengalaman &quot;ngemil&quot; yang tak terlupakan.<br><br>Didirikan oleh almarhum Tuan Ng Sun Lim dan putranya, yang saat ini menjadi Chief Executive Officer, Mr Michael Ng. Perusahaan ini telah mengalami revolusi dari model pengolahan tradisional menjadi sitem pengolahan yang modern untuk menghasilkan produk makanan yang berkualitas dan telah menerapkan standarisasi industri yang tinggi. Saat ini manufaktur SLG Group memiliki fasilitas produksi khusus seluas 20.000 meter persegi.<br><br>Selama lebih dari seperempat abad, perusahaan yang sekarang dikenal dengan &quot;SLG Group&quot;, menjadi spesialis dalam memproses, mengemas dan memasarkan beragam makanan ringan premium, termasuk kacang-kacangan, buah kering dan kerupuk. Sejalan dengan filosofi kualitas dan inovasi ini, CEO kami saat ini, Michael Ng telah membangun kembali merek andalan perusahaan kami yaitu &quot;Kangaroo&quot; menjadi trend setter untuk kategori makanan ringan.&nbsp;', 'https://www.indonut.co.id', 4440000, 'logo-kangaroo.webp', 'kangaroo-1.webp', 'kangaroo-2.webp', 'kangaroo-3.webp', 'kangaroo-4.webp', 'kangaroo-5.webp', 'Thank you so much buat diw dalam pengerjaan website kangaroonya...webnya sesuai dengan apa yang diminta ga nyesel custom web di diw &eth;&Yuml;&tilde;&Scaron; buat nextnya pasti bikin di diw lg 👍 👍 👍&nbsp;', '', '2019-10-07', '2017-08-31 16:56:00', '', 1, 'kangaroo', 1, NULL, 