(75, 'PORTFOLIO000075', 3, 77, 'u0194293', ')@+e#3%@Zf', 1, 'Bozq The Uniform', NULL, 'BozQ adalah sebuah perusahaan yang melayani Design dan Pembuatan seragam menggunakan berbagai macam bahan dan beragam design yang sudah disiapkan oleh designer baju terbaik ataupun menggunakan Design yang anda coba wujudkan.\n\nKami menghadirkan beberapa design seragam dengan bentuk kemeja dengan beberapa pilihan bahan dan motif disertai dengan pembuatan seragam dengan design yang anda coba wujudkan.', 'http://www.bozqtheuniform.id', 1500000, 'logo-bozq-the-uniform.webp', 'bozq-the-uniform-1.webp', 'bozq-the-uniform-2.webp', 'bozq-the-uniform-3.webp', 'bozq-the-uniform-4.webp', 'bozq-the-uniform-5.webp', '', '', '2018-09-13', '2017-09-13 19:55:00', '', 1, 'bozq-the-uniform', 1, NULL, NULL, NULL, '2017-09-12 08:55:00', '2020-11-07 08:03:42', NULL),
(76, 'PORTFOLIO000076', 14, 78, 'fswm6638', 'DIW.co.id2017!', 1, 'Freedom Space', NULL, 'Freedom Space merupakan sebuah media platform yang bergerak dalam bidang digital, dimana penggunanya dapat mengakses platform kami melalui website kami.\n\nFreedom Space sendiri adalah penghubung antara pekerja maupun para wirausahawan dengan pemilik ruangan bisnis, khususnya co-working. Selain sebagai penghubung, Freedom Space juga menyediakan sekumpulan informasi mengenai Business Space, dimana informasi tersebut mencakup tentang co-working, meeting room, serta auditorium. Freedom Space sendiri juga ingin membangun dan menjalin kerja sama, baik dengan pemilik ruang bisnis maupun para pengguna ruangan, juga dengan masyarakat yang memiliki jenis-jenis usaha yang beragam dan inovatif. Selain itu, Freedom Space juga ingin memberikan sebuah gambar baru di dunia kewirausahaan, dimana memiliki usaha sendiri tidaklah begitu sulit dan membosankan, melainkan memiliki usaha sendiri dapat membawa suasan tersendiri bagi pemilik bisnis, bahkan dengan mencari dan bekerja ditempat yang nyaman, suasana bekerja pun juga semakin meningkat.\n\nFreedom Space berawal dari sebuah tugas salah satu mata kuliah, dan pada akhirnya kami jadikan sebuah start up bisnis yang dapat memberikan kemudahan para pengguna ruangan bisnis untuk menemukan ruangan yang mereka inginkan, sehingga mereka juga menemukan suasana bekerja yang mereka inginkan.', 'https://www.fsworkspace.com', 3000000, 'logo-freedom-space.webp', 'freedom-space-1.webp', 'freedom-space-2.webp', 'freedom-space-3.webp', 'freedom-space-4.webp', 'freedom-space-5.webp', '', '', '2018-09-16', '2017-09-15 20:07:00', '', 1, 'freedom-space', 1, NULL, NULL, NULL, '2017-09-14 09:07:00', '2020-11-07 08:03:42', NULL),
(77, 'PORTFOLIO000077', 15, 79, 'tonw7699', 'TondanoResidence2017!', 1, 'Tondano Residence', NULL, 'Welcome To Tondano Residence\nA Place For Busiines, Relax, And Fun\n\nIn operation since Januari 2016, Tondano Residence has been steadily growing and providing quality hospitality service during the stay of our guests and other associated events. We have 50 available rooms ranging from standard and deluxe rooms Our facilities include: Wi-Fi Cable TV Air Conditioning Heated Pool Meeting Room Gym And Cafe.\n\nTondano Residence berlokasi di sekitaran Senayan, berdiri tepat di pusat aktivitas dan hiburan ibukota. Letak yang strategis di daerah perkantoran dan pusat perbelanjaan menjadikan Tondano Residence sebagai pilihan tepat bagi anda yang sedang mengunjungi Jakarta untuk berbisnis, berlibur, atau wisata kuliner. Demi memberikan pengalaman menginap yang memuaskan, kami berkomitmen untuk memberikan pelayanan dan fasilitas terbaik bagi Anda.', 'https://www.tondanoresidence.com', 3473000, 'logo-tondano-residence.webp', 'tondano-residence-1.webp', 'tondano-residence-2.webp', 'tondano-residence-3.webp', 'tondano-residence-4.webp', 'tondano-residence-5.webp', 'Terima kasih DIW, senang bisa dibantu oleh DIW, team nya helpfull, ramah dan sabar.\nSangat direkomendasikan.', 'https://www.facebook.com/andy.aldrin/posts/10211008885803330', '2019-09-24', '2017-09-24 10:17:00', '', 1, 'tondano-residence', 1, NULL, NULL, NULL, '2017-09-22 23:17:00', '2020-11-07 08:03:42', NULL),
