(81, 'PORTFOLIO000081', 1, 83, 'dinx1753', 'rXT3ydGm91yK32', 1, 'PT Dinamika Unggul Perkasa', NULL, 'Sejarah Lebih baik - pengalaman DUP merupakan pelopor dalam sistem window U-PVC di Indonesia dan telah berdiri sejak 1996. Di bawah merek FEGA dan FESIA, kami memproduksi jendela dan pintu U-PVC untuk apartemen pribadi, apartemen mewah dan hotel bintang lima. 2009 Massa pertama menghasilkan jendela PVC-U untuk pasar menengah-atas dengan merek &quot;FESIA&quot;. 1996 Pendiri perusahaan DUP di Tangerang dan massa pertama diproduksi PVC-U windows dengan merek &quot;FEGA&quot; untuk pasar high end. Visi Kami adalah pemimpin di industri jendela U-PVC, yang memberikan nilai terbaik untuk layanan dan kualitas produk terbaik bagi pelanggan kami sekaligus menghasilkan tingkat pengembalian aset yang tinggi bagi para pemegang saham kami. Misi Kami adalah perusahaan yang sukses, yang mendukung industri konstruksi melalui produk dan layanan yang bermanfaat bagi umat manusia. Tujuan Pembuat kaca terbaik di dunia.', 'https://www.dinamikaunggulperkasa.com', 2100000, 'logo-pt-dinamika-unggul-perkasa.webp', 'pt-dinamika-unggul-perkasa-1.webp', 'pt-dinamika-unggul-perkasa-2.webp', 'pt-dinamika-unggul-perkasa-3.webp', 'pt-dinamika-unggul-perkasa-4.webp', 'pt-dinamika-unggul-perkasa-5.webp', 'Terima kasih yah koh atas bantuan nya selama KP dan Skripsi 🙏 nnti klo ada yg mw bkin website, saya rekomendasikan skalian 👍 &nbsp;Thank you yah koh', '', '2019-06-28', '2017-09-17 23:17:00', '', 1, 'pt-dinamika-unggul-perkasa', 1, NULL, NULL, NULL, '2017-09-16 12:17:00', '2020-11-07 08:03:42', NULL),
(82, 'PORTFOLIO000082', 1, 42, '', '', 1, 'CV Tri Usaha Pangan', NULL, 'Sejarah CV. Tri Usaha Pangan adalah sebuah perusahaan jual beli beras yang didirikan pada Tahun 1999. Diawali dari sewa kios yang bergerak di bagian pembelian dan penjualan beras, kini CV. Tri Usaha Pangan kini sudah memiliki lokasi tetap di daerah Jakarta yang beralamatkan Jalan Pisangan Lama, Pertokoan Pasar Beras Induk Cipinang. CV. Tri Usaha Pangan. Blok A 23 AA. 23. Awalnya CV. Tri Usaha Pangan ini membeli 1 ton beras dan kemudian di jual lagi ke eceran atau warung-warung kecil untuk jual beli beras. Setelah beberapa tahun, kini CV. Tri Usaha Pangan membeli banyak ton-ton beras atau dapat dari Bulog (Badan Urusan Logistik) dan juga di stock atau di simpan di gudang. Ada juga yang langsung di menyerahkan lagi ke tempat lain baik itu di dalam daerah maupun di luar daerah.', '', 0, 'logo-cv-tri-usaha-pangan.webp', 'cv-tri-usaha-pangan-1.webp', 'cv-tri-usaha-pangan-2.webp', 'cv-tri-usaha-pangan-3.webp', 'cv-tri-usaha-pangan-4.webp', 'cv-tri-usaha-pangan-5.webp', '', '', NULL, '2017-03-06 09:23:00', '', 0, 'cv-tri-usaha-pangan', 1, NULL, NULL, NULL, '2017-03-04 22:23:00', '2020-11-07 08:03:42', NULL),
(83, 'PORTFOLIO000083', 1, 84, 'aarti', 'a4rt!j4y4', 1, 'PT AARTI JAYA', NULL, 'Kami merupakan perusahaan retail pertama di Indonesia yang bergerak di bidang perdagangan ritel yang meliputi keperluan muslim. Bursa Sajadah telah membuka enam gerai di lima kota besar di Indonesia : Bandung, Jakarta, Bogor, Bekasi dan Surabaya. Sejalan dengan waktu Bursa Sajadah berkembang pesat dengan 4 anak perusahaan yang terdiri dari Sykava, Velteksa, Arofah, dan Zaleera. Kunjungi kami di : www.bursasajadah.com, www.sykava.com; www.velteksa.com; www.arofah.com; www.zaleera.com atau twitter : @bursasajadah Facebook : bursasajadah.\r\n\r\nPT.Aarti Jaya (Bursa Sajadah) bergerak dalam penjualan perlengkapan muslim dan oleh-oleh Haji/Umroh yang berdiri sejak tahun 1998. Kami menyediakan beraneka macam oleh-oleh dan perlengkapan Haji/Umroh yang lengkap serta menyediakan berbagai keperluan muslim lainnya. Kami telah membuka delapan gerai di tujuh kota besar di Indonesia : Bandung, Jakarta, Bogor, Bekasi Solo, Malang dan Surabaya. Sejalan dengan waktu Bursa Sajadah berkembang pesat dengan empat anak perusahaan yang terdiri dari Sykava, Velteksa, Arofah, dan Zaleera. www.bursasajadah.com\r\n\r\nWebsite: http://www.aartijaya.com\r\nIndustri: Ritel\r\nJenis: Perusahaan Publik\r\nKantor Pusat: Jl. Kopo Bihbul Km. 6,5/20 No. 12 40225 Bandung, Jawa Barat 40225 Indonesia\r\nUkuran Perusahaan: 201-500 karyawan\r\nTahun Berdiri: 1998', 'http://www.aartijaya.com', 500000, 'logo-pt-aarti-jaya.webp', 'pt-aarti-jaya-1.webp', 'pt-aarti-jaya-2.webp', 'pt-aarti-jaya-3.webp', 'pt-aarti-jaya-4.webp', 'pt-aarti-jaya-5.webp', NULL, NULL, '2022-01-02', '2017-10-14 18:01:00', NULL, 1, 'pt-aarti-jaya', 1, NULL, NULL, NULL, '2017-10-13 07:01:00', '2021-03-13 20:22:06', NULL),
(84, 'PORTFOLIO000084', 17, 85, 'lavq8346', 'Lavonnewcity2017!', 1, 'Lavon New City', NULL, 'Lavon New City - Rumah Mewah 2 Lantai Cikupa Tangerang Lavon adalah Perumahan Baru Konsep Cluster Berlokasi Strategis dengan Akses Toll Langsung di Tangerang. Rumah Mewah 2 Lantai Harga 750 Jutaan dengan Fasilitas Lengkap. Pengembang Lavon Swan City Cikupa Tangerang adalah SWAN CITY merupakan salah satu pemimpin pengembang kota industri yang berdiri sejak tahun 1998. Ada 4 prinsip utama Swan City dalam membangun kota industri baru yang terus dipegang teguh meliputi: 1. Komitmen untuk green development 2. Komitmen untuk kualitas hidup di kota kita 3. Komitmen untuk terus menerus berinovasi 4. Komitmen untuk membawa kebersamaan dalam industri Lavon berlokasi strategis 500 meter dari Pintu Tol Cikupa Tangerang (KM.31 Toll Jakarta - Tangerang) ,10 menit dari Toll Karawaci (KM.21) dan 20 menit dari Puri Indah Jakarta Barat. Lavon akan dapat diakses dengan future Toll Road Serpong -Balaraja dan Toll Road Balaraja - Airport serta terdapat future MRT Station yang rencananya akan dibangun pada tahun 2019 dan ditargetkan selesai pada tahun 2023. Lavon juga dapat diakses dari Jalan Pasar Kemis Raya Tangerang. Pilihan tepat investasi properti terbaru di Cikupa, Tangerang. Kami adalah sales marketing properti rumah Lavon Swan City di Cikupa Tangerang. Hubungi saya sekarang juga untuk membeli rumah di Lavon by Swan City CFLD sekarang! Telepon/SMS : 0812 187 1010 Whatsapp : 0812 187 1010 Email : dedy_lukmanaa@yahoo.com', 'https://www.lavonnewcity.com', 2650000, 'logo-lavon-new-city.webp', 'lavon-new-city-1.webp', 'lavon-new-city-2.webp', 'lavon-new-city-3.webp', 'lavon-new-city-4.webp', 'lavon-new-city-5.webp', 'Ga ush ragu guys sm diw pasti hasil ny bagus 👍👍&nbsp;', 'https://www.facebook.com/dedy.lukmana/posts/1972268366122294', '2018-10-27', '2017-10-26 21:45:00', '', 1, 'lavon-new-city', 1, NULL, NULL, NULL, '2017-10-25 10:45:00', '2020-11-07 08:03:42', NULL),
(85, 'PORTFOLIO000085', 2, 90, 'theshelt', '4ymxB38F2s', 1, 'The Shelton Group Indonesia', NULL, 'The Shelton Group Indonesia is a holding company engaged in the field of health, food and drinks and hospitality. Our company was established since the beginning of 2016. We are committed to providing the best service in each business unit that we run. We continue to seek mutually beneficial business opportunities that create synergies, build alliances and strengthen our support business with and through our subsidiaries, primarily The Shelton Nutrition and Hotel Panorama Green View. We are looking for people who have a passion for progress, combined with key quality of humility, dedication and sincerity. It is the values have enabled us to work in harmony.', '//www.theshelton.co.id', 5000000, 'logo-the-shelton-group-indonesia.webp', 'the-shelton-group-indonesia-1.webp', 'the-shelton-group-indonesia-2.webp', 'the-shelton-group-indonesia-3.webp', 'the-shelton-group-indonesia-4.webp', 'the-shelton-group-indonesia-5.webp', NULL, NULL, '2022-08-11', '2017-11-15 08:03:00', NULL, 1, 'the-shelton-group-indonesia', 1, NULL, NULL, NULL, '2017-11-13 21:03:00', '2022-04-29 05:21:58', NULL),
(86, 'PORTFOLIO000086', 1, 18, 'dasq1418', 'DasanaIndahTangerang2017!', 1, 'Dasana Indah Tangerang 002 015', NULL, 'Warga Perumahan Dasana Indah, khususnya RT 002 RW 015 adalah warga yang menetap di wilayah RT 002 yang diresmikan, diputuskan dan ditetapkan oleh Kepala Kelurahan Bojong Nangka, Kecamatan Kelapa Dua Tangerang yang di pimpin oleh H. Yayat Rohiman.\r\n\r\nKedudukan dan Status Warga RT 002/015 adalah warga yang menetap dan tinggal di wilayah RT 002/015, baik dirumah milik sendiri atau pun kontrak.\r\n\r\nAdapun Kebijakan Pindahan dari RT 002/015 sebagai berikut:\r\n1. Warga yang pindah keluar wilayah RT 002 diwajibkan melapor ke pengurus RT 002 dan membuat surat pindah dari RT 002 RW 015\r\n2. Warga yang pindah keluar wilayah RT 002, bukan lagi warga RT 015.\r\n3. Warga yang masih memiliki kartu tanda penduduk RT 002, tetapi tidak lagi tinggal di wilayah RT 002 bukan warga RT 002.\r\n4. Dalam hal-hal tertentu ketua RT berhak mengambil kebijakan.', 'https://www.dasanaindahrt002-015.com', 1300000, 'logo-dasana-indah-tangerang-002-015.webp', 'dasana-indah-tangerang-002-015-1.webp', 'dasana-indah-tangerang-002-015-2.webp', 'dasana-indah-tangerang-002-015-3.webp', 'dasana-indah-tangerang-002-015-4.webp', 'dasana-indah-tangerang-002-015-5.webp', NULL, NULL, '2018-11-22', '2017-11-22 19:44:00', NULL, 1, 'dasana-indah-tangerang-002-015', 1, NULL, NULL, NULL, '2017-11-21 08:44:00', '2021-03-04 01:22:55', NULL),
