(88, 'PORTFOLIO000088', 1, 132, '', '', 1, 'Suku Baduy', NULL, 'Apa Itu Suku Baduy ?\nUrang Kanekes, Orang Kanekes atau Orang Baduy atau Badui merupakan kelompok masyarakat adat sub-etnis Sunda di wilayah Kabupaten Lebak, Banten. Populasi mereka sekitar 11.000 orang, dan mereka merupakan salah satu suku yang mengisolasi diri mereka dari dunia luar.', '', 1500000, 'logo-suku-baduy.webp', 'suku-baduy-1.webp', 'suku-baduy-2.webp', 'suku-baduy-3.webp', 'suku-baduy-4.webp', 'suku-baduy-5.webp', '', '', NULL, '2017-12-04 11:00:00', '', 0, 'suku-baduy', 1, NULL, NULL, NULL, '2017-12-03 00:00:00', '2020-11-07 08:03:43', NULL),
(89, 'PORTFOLIO000089', 1, 134, '', '', 1, 'Wisata Alam', NULL, 'Website Wisata Alam merupakan website yang mengelolah isi wisata alam yang ada di kabupaten lebak, banten yang bertujuan untuk menginformasikan apa saja tujuan, biaya, dan budaya yang ada.\n\nMENURUT SK. MENPARPOSTEL NO.: KM. 98 / PW.102 / MPPT-87\nObjek Wisata adalah semua tempat atau keadaan alam yang memiliki sumber daya wisata yang dibangun dan dikembangkan sehingga mempunyai daya tarik dan diusahakan sebagai tempat yang dikunjungi wisatawan.\n\nTujuan dari wisata alam:\n- Meningkatkan pertumbuhan ekonomi\n- Meningkatkan rasa cinta tanah air\n- Meningkatkan kesejahteraan bangsa', '', 1500000, 'logo-wisata-alam.webp', 'wisata-alam-1.webp', 'wisata-alam-2.webp', 'wisata-alam-3.webp', 'wisata-alam-4.webp', 'wisata-alam-5.webp', '', '', NULL, '2017-12-05 17:33:00', '', 0, 'wisata-alam', 1, NULL, NULL, NULL, '2017-12-04 06:33:00', '2020-11-07 08:03:43', NULL),
(90, 'PORTFOLIO000090', 1, 65, '', '', 1, 'Bangunan Bersejarah', NULL, 'Situs ini merupakan salah satu upaya untuk memperkenalkan bangunan bersejarah kota serang kepada masyarakat.\n\nSitus ini berisikan informasi tentang bangunan bersejarah kota serang dimulai dari foto, event, deskripsi lengkap, dan video.', '', 1500000, 'logo-bangunan-bersejarah.webp', 'bangunan-bersejarah-1.webp', 'bangunan-bersejarah-2.webp', 'bangunan-bersejarah-3.webp', 'bangunan-bersejarah-4.webp', 'bangunan-bersejarah-5.webp', '', '', NULL, '2017-12-05 19:31:00', '', 0, 'bangunan-bersejarah', 1, NULL, NULL, NULL, '2017-12-04 08:31:00', '2020-11-07 08:03:43', NULL),
(91, 'PORTFOLIO000091', 1, 135, '', '', 1, 'Cagar Budaya', NULL, 'DEFINISI\nCagar Budaya dapat diketahui bahwa cagar budaya didefinisikan sebagai kekayaan budaya bangsa sebagai wujud pemikiran dan perilaku kehidupan manusia yang penting artinya bagi pemahaman dan pengembangan sejarah, ilmu pengetahuan, dan kebudayaan dalam kehidupan bermasyarakat, berbangsa, dan bernegara sehingga perlu dilestarikan dan dikelola secara tepat melalui upaya pelindungan, pengembangan, dan pemanfaatan dalam rangka memajukan kebudayaan nasional untuk sebesar-besarnya kemakmuran rakyat.\n\nKATEGORI CAGAR BUDAYA\nCagar budaya sendiri dapat berupa:\n- Benda\n- Bangunan\n- Struktur\n- Situs\n- Kawasan\n\nKRITERIA CAGAR BUDAYA\nAdapun kriteria yang harus dipenuhi dalam penetapan cagar budaya adalah:\n- Berusia 50 tahun atau lebih\n- Mewakili masa gaya paling singkat berusia 50 tahun\n- Memiliki arti khusus bagi sejarah, ilmu pengetahuan, pendidikan, agama, dan/atau kebudayaan\n- Memiliki nilai budaya bagi penguatan kepribadian bangsa\n\nPada setiap objek wisata yang didaftarkan sebagai cagar budaya akan di verifikasi oleh Dinas Pemerintah Daerah terkait dan selanjutnya akan dikaji oleh Tim Ahli. Jika hasil kajian menyatakan objek tersebut merupakan objek cagar budaya, maka akan ditetapkan dengan Surat Keputusan(SK) Penetapan Cagar Budaya dan mendapatkan Nomor Registrasi Nasional dari objek yang didaftarkan.\n\nInformasi mengenai cagar budaya secara lebih detail dapat dilihat pada Undang-Undang Nomor 11 Tahun 2010 tentang Cagar Budaya.', '', 1500000, 'logo-cagar-budaya.webp', 'cagar-budaya-1.webp', 'cagar-budaya-2.webp', 'cagar-budaya-3.webp', 'cagar-budaya-4.webp', 'cagar-budaya-5.webp', '', '', NULL, '2017-12-08 08:43:00', '', 0, 'cagar-budaya', 1, NULL, NULL, NULL, '2017-12-06 21:43:00', '2020-11-07 08:03:43', NULL),
(92, 'PORTFOLIO000092', 1, 137, '', '', 1, 'Global Network Solution', NULL, 'Global Network Solutions (GNS) is a trusted partner to companies for managing their VoIP Systems, data services and technology critical processes. We are an IT and data service organization with global capabilities focused on delivering smart, next-generation business solutions that help individuals and enterprises overcome their business challenges. These solutions leverage innovations in technology, knowledge of business processes and domain expertise to provide our clients with a competitive edge. \n\nAs a strategic partner, Global Network Solutions helps our clients improve their business competitiveness and achieve operational efficiencies. The benefits we deliver include lower total cost of ownership, maximized productivity and efficiency in business processes and the IT infrastructure to ensure long term network stability and business continuation.', '', 500000, 'logo-global-network-solution.webp', 'global-network-solution-1.webp', 'global-network-solution-2.webp', 'global-network-solution-3.webp', 'global-network-solution-4.webp', 'global-network-solution-5.webp', '', '', NULL, '2017-12-10 13:00:00', '', 0, 'global-network-solution', 1, NULL, NULL, NULL, '2017-12-09 02:00:00', '2020-11-07 08:03:43', NULL),
