(95, 'PORTFOLIO000095', 3, 141, 'newz7367', 'APCavIxSfD2V3Z7tyE6l', 1, 'New York Time', NULL, 'Jam tangan juga telah menjadi simbol status seseorang. Pemilihan jam tangan adalah sesuatu yang cukup penting. Sangat penting untuk mengetahui fakta dan tujuan untuk apa anda membutuhkannya. Ada ribuan merek jam tangan yang diproduksi di seluruh dunia. Sebelumnya, orang membeli jam tangan hanya untukmengetahui informasi tentang waktu tapi saat ini situasi sudah berbeda.', 'https://www.newyorktime.co.id', 5440000, 'logo-new-york-time.webp', 'new-york-time-1.webp', 'new-york-time-2.webp', 'new-york-time-3.webp', 'new-york-time-4.webp', 'new-york-time-5.webp', '', '', '2020-01-14', '2018-01-12 12:49:00', '', 1, 'new-york-time', 1, NULL, NULL, NULL, '2018-01-11 01:49:00', '2020-11-07 08:03:43', NULL),
(96, 'PORTFOLIO000096', 4, 142, 'dunm7645', 'FWd2U5DTuzTP18', 1, 'Dunia Frans', NULL, 'Hi, Panggil saja aku Frans. Aku asli Tangerang yang tinggal sementara di Jakarta. Dunia Frans hanyalah tempat aku meletakkan karya-karyaku untuk dinikmati. Bagaimana aku ingin mengekspresikan diriku lewat pengalaman yang aku punya. Bagus kalau dijadikan referensi. Yaa.. jangan sampai dibajak aja, ya. Hehehe.\n\nAku biasa dikenal dengan Frans Sitanggang. Lulusan dari kampus Politeknik Negeri Media Kreatif Jakarta program studi Desain Grafis. Sekarang sedang melanjutkan Studi S1 nya di Universitas Paaramadina dengan jurusan Desain Komunikasi Visual.\n\nKalau ditanya pekerjaan, saat ini aku freelance illustrator dan videographer saja. Cukuplah untuk membiayai hidup sehari-hari hehee..', 'https://www.duniafrans.com', 3000000, 'logo-dunia-frans.webp', 'dunia-frans-1.webp', 'dunia-frans-2.webp', 'dunia-frans-3.webp', 'dunia-frans-4.webp', 'dunia-frans-5.webp', '', '', '2019-02-08', '2018-02-08 13:54:00', '', 1, 'dunia-frans', 1, NULL, NULL, NULL, '2018-02-07 02:54:00', '2020-11-07 08:03:43', NULL),
