(115, 'PORTFOLIO000115', 17, 175, 'tana2847', 'vhQZ64siNZ6Z56', 1, 'Tangerang Citra Raya', NULL, 'CitraRaya Tangerang merupakan The largest integrated township development by Ciputra Group. Proyek terbesar Ciputra Group seluas 2,760 Hektar (Ha) ini merangkum hunian, komersil dan fasilitas umum yang lengkap dan modern. Sebagai kota mandiri modern yang mulai dikembangkan sejak tahun 1994, CitraRaya telah mengalami pertumbuhan yang sangat pesat dan mencatatkan diri sebagai Regional and Business Center yang kuat di Tangerang. Terlebih, kini telah beroperasional ratusan fasilitas pendidikan, rekreasi, kesehatan, agama dan retail untuk memenuhi semua kebutuhan warga di dalam dan sekitarnya. Terlebih lagi, kawasan CitraRaya ini semakin meningkat dengan komitmennya untuk mengedepankan konsep kota yang berkesinambungan, melalui peluncuran program EcoCulture di tahun 2011. Tak salah bila kini CitraRaya telah menjadi rumah bagi lebih dari 65 ribu jiwa yang menempati lebih dari 51 cluster perumahan dan 1.800 unit komersial, menjadikannya sebagai salah satu perumahan terbesar di Tangerang.\n\nPromo Terbaru Ciputra Group Perumahan Citra Raya Hunian Terbaru Lugano Lake Park dan Cluster Pine Tree Tangerang Hubungi Daniel Haither Christofel 085338734771.', 'https://www.tangerangcitraraya.com', 3000000, 'logo-tangerang-citra-raya.webp', 'tangerang-citra-raya-1.webp', 'tangerang-citra-raya-2.webp', 'tangerang-citra-raya-3.webp', 'tangerang-citra-raya-4.webp', 'tangerang-citra-raya-5.webp', '', '', '2019-11-08', '2018-11-08 10:58:00', '', 1, 'tangerang-citra-raya', 1, NULL, NULL, NULL, '2018-11-06 23:58:00', '2020-11-07 08:03:43', NULL),
