(140, 'PORTFOLIO000140', 17, 267, 'thet9674', '3tUuPxLA9jMeNETmXBQk', 1, 'The Altitude Apartment South Gate', NULL, '<strong>The Altitude @ SouthGate<br>Life Simply &ndash; Dream Big &ndash; Discover Joy - Developer By Sinarmas Land</strong><br><br>The Altitude Apartment South Gate merupakan tower terbaru dari Superblock Southgate Apartement, dibangun oleh developer berpengalaman yaitu Sinar Mas Land yang berdiri di luas lahan 5,4 Ha (Hektar) yang akan menjadi icon baru kawasan ini dan akan menjadi pendorong kemajuan kawasan sekitarnya agar lebih tertata dan lebih modern. Ditujukan untuk Eksekutif Muda &amp; Pengusaha Muda yang masih menawarkan dengan harga perdana, sehingga sangat menguntungkan buat para investor.<br><br>The Altitude Apartment South Gate berlokasi di kawasan TB Simatupang Jakarta Selatan tepatnya Di Jln Tanjung barat No. 163 dan terintegrasi dengan AEON Mall Jakarta Selatan, berada di lokasi yang menawarkan kemudahan akses, pilihan, dan kesenangan bagi para profesional maupun wirausahawan yang mencari gaya hidup efisien sehingga penghuni dapat menikmati lingkungan yang lebih hidup dibanding di tempat lain dan terintengrasi yang mana semua kebutuhan ada didalam satu area kawasan yang terdiri dari Apartment, Office Tower, Hotel, Mall (Mixed Used Development), dan berada di sebrang stasiun memudahkan anda untuk bermobilitas agar dapat melengkapi perkembangan area ini menjadi pusat bisnis baru (CBD) di Jakarta.', 'https://www.thealtitudeapartment-southgate.com', 1000000, 'logo-the-altitude-apartment-south-gate.webp', 'the-altitude-apartment-south-gate-1.webp', 'the-altitude-apartment-south-gate-2.webp', 'the-altitude-apartment-south-gate-3.webp', 'the-altitude-apartment-south-gate-4.webp', 'the-altitude-apartment-south-gate-5.webp', NULL, NULL, '2019-09-25', '2019-09-25 11:04:12', NULL, 1, 'the-altitude-apartment-south-gate', 1, NULL, NULL, NULL, '2019-09-24 07:59:43', '2020-11-07 08:03:43', NULL),
