(147, 'PORTFOLIO000147', 17, 274, 'bink6859', 'IMbi7d3oaTS40u1vjpJl', 1, 'Bintaro Paradiso', NULL, 'Hunian sempurna dengan gaya modern minimalis di jantung kawasan Bintaro.&nbsp;<strong>Bintaro Paradiso</strong> menawarkan kenyamanan, keamanan, dan lingkungan asri untuk Anda dan keluarga. Raihlah kemudahan hidup dengan hunian yang dikelilingi fasilitas pendidikan, pusat perbelanjaan, rumah sakit, dan pusat kuliner.<br><br>Tinggal nyaman di daerah hunian paling strategis di Jakarta Selatan, bisa banget! Bintaro dari dulu memang sudah terkenal sebagai salah satu daerah hunian elit dan nyaman buat sebagian masyarakat Jakarta Selatan dan Tangerang Selatan. Akses yang mudah menuju pusat kota dan lengkap dengan berbagai destinasi hiburan, restoran dan kafe, membuat Bintaro jadi daerah yang sangat strategis.<br><br><strong>Bintaro Paradiso</strong> Di Develop Oleh&nbsp;<strong>PT Hekta Karya</strong>. PT Hekta Karya adalah perusahaan pengembang perumahan dengan proyek-proyek pembangunan yang berlokasi di Kota Tangerang Selatan dan sekitarnya. Berbekal ketekunan tim dan kepercayaan dari para pemangku kepentingan, kami berupaya mewujudkan harapan keluarga Indonesia memiliki rumah idaman dengan harga yang sesuai.<br><br><strong>PT Hekta Karya</strong> sudah mengembangkan project, diantaranya, Bumi Cisauk Asri, Bumi Pamulang Asri, Bumi Bintaro Asri, Bumi Bintaro Asri 2, De Viva Bintaro, dan Bale Perigi Bintaro (kunjungi www.hektakarya.com)<br><br>', '//www.bintaroparadiso.com', 2000000, 'logo-bintaro-paradiso.webp', 'bintaro-paradiso-1.webp', 'bintaro-paradiso-2.webp', 'bintaro-paradiso-3.webp', 'bintaro-paradiso-4.webp', 'bintaro-paradiso-5.webp', NULL, NULL, '2022-12-17', '2019-12-17 10:49:09', 'Start Brief : 2019-12-17 - 10:49:09', 1, 'bintaro-paradiso', 1, NULL, NULL, NULL, '2019-12-16 14:14:53', '2022-04-29 04:24:06', NULL),
