(182, 'PORTFOLIO000182', 1, 406, NULL, NULL, 1, 'Sinar Mulia Keramik', NULL, '<span style=\"font-size: 13.2px;\">Sinar Mulia Keramik berdiri sejak tahun 1993 berlokasi di Jl. Pagongan No.5 Pekalangan Pekalipan yang menjual berbagai macam keramik, granite, closet &amp; sanitary. Sinar Mulia Keramik mampu bersaing dengan bisnis lainnya di area bisnis, melalui produk andalannya yaitu Sanitary Bermutu. Mampu memberikan jaminan kualitas untuk semua pelanggan.</span>', NULL, 1350000, 'logo-sinar-mulia-keramik.webp', 'sinar-mulia-keramik-1.webp', 'sinar-mulia-keramik-2.webp', 'sinar-mulia-keramik-3.webp', 'sinar-mulia-keramik-4.webp', 'sinar-mulia-keramik-5.webp', NULL, NULL, '2021-04-12', '2021-04-11 18:47:00', NULL, 1, 'sinar-mulia-keramik', 1, NULL, NULL, NULL, '2021-04-12 01:30:40', '2021-08-06 12:46:58', NULL),
(183, 'PORTFOLIO000183', 1, 389, NULL, NULL, 1, 'PT Karya Mandiri Marmer', NULL, 'Sistem Rekrutmen Karyawan Menggunakan Metode Decision Tree Untuk Mempermudah Penerimaan Dan Penyeleksian Karyawan Baru Pada PT Karya Mandiri Marmer<div><br></div><div>Di era maju seperti sekarang banyak sekali peralihan teknologi ke digital. Oleh karena itu, banyak perusahaan yang memiliki departemen teknologi informasi atau sistem informasi. Begitu juga dengan PT. Karya Mandiri Marmer, sebuah perusahaan yang bergerak dalam bidang bidang perdagangan marmer dan granit, pada perusahaan ini untuk proses recruitment karyawan masih bersifat manual, tidak adanya metode otomatis untuk memilih karyawan yang sesuai dengan kriteria PT Karya Mandiri Marmer. Hal ini yang sering membuat keadaan menjadi rumit karena penerimaan karyawan ,dan membuat file berkas menumpuk , sangat kurang efektif. Oleh karena itu peneliti mencoba memberikan solusi, dengan membuat sebuah sistem yang efisien, cepat dan juga sangat simple tanpa ada berkas tumpukan file lagi. Dalam penyeleksian ini, terdapat SPK (Sistem Penunjang Keputusan) dengan metode Decision Tree, Yang dapat digunakan dalam pemecahan masalah yang bersifat objektif/kuantitatif dengan metode Decision Tree masing- masing kriteria dibandingkan satu dengan yang lain, sehingga memberikan hasil yang akurat dan memberikan penilaian terhadap setiap calon tenaga kerja baru di PT Karya Mandiri Marmer.</div>', NULL, 3000000, 'logo-pt-karya-mandiri-marmer.webp', 'pt-karya-mandiri-marmer-1.webp', 'pt-karya-mandiri-marmer-2.webp', 'pt-karya-mandiri-marmer-3.webp', 'pt-karya-mandiri-marmer-4.webp', 'pt-karya-mandiri-marmer-5.webp', NULL, NULL, '2021-05-02', '2021-05-02 15:18:56', NULL, 0, 'pt-karya-mandiri-marmer', 1, NULL, NULL, NULL, '2021-05-02 10:11:56', '2021-11-20 01:18:18', NULL),
