(189, 'PORTFOLIO000189', 2, 408, 'mdvcoid1', '1r2*kaCMXfX14*', 1, 'PT MDV Indonesia', NULL, '<div><span style=\"font-size: 13.2px;\">PT MDV Indonesia is an Importer in Indonesia, We provide complete trade details of Importers like Product, Price, Quantity, HS code, Ports and suppliers.</span></div><div><span style=\"font-size: 13.2px;\"><br></span></div><div><span style=\"font-size: 13.2px;\">Perusahaan Sispo Kontruksi</span></div><div><span style=\"font-size: 13.2px;\">Didirikan sejak tahun 2009 dan sangat berpengalaman di bidang HVAC dengan pengalaman pendiri lebih dari 40 tahun.</span></div><div><span style=\"font-size: 13.2px;\">Visi kami adalah menjadi pemimpin dalam distribusi produk yang terintegrasi dengan pelayanan purna jual terbaik.</span></div><div><span style=\"font-size: 13.2px;\">Misi kami adalah menyediakan udara yang sehat dan bersih dengan sistem tata udara yang berkualitas.</span></div><div><span style=\"font-size: 13.2px;\">Produk yang kami jual adalah :</span></div><div><span style=\"font-size: 13.2px;\">1. Air Conditioner Merk Fuji Ac</span></div><div><span style=\"font-size: 13.2px;\">2. Sandwich Panel Merk Subzero</span></div><div><span style=\"font-size: 13.2px;\">3. The Insulation Expert Merk Versa Foam</span></div>', '//www.mdv.co.id', 15000000, 'logo-pt-mdv-indonesia.webp', 'pt-mdv-indonesia-1.webp', 'pt-mdv-indonesia-2.webp', 'pt-mdv-indonesia-3.webp', 'pt-mdv-indonesia-4.webp', 'pt-mdv-indonesia-5.webp', NULL, NULL, '2023-01-14', '2021-08-12 11:38:54', NULL, 1, 'pt-mdv-indonesia', 1, NULL, NULL, NULL, '2021-08-11 21:40:55', '2022-01-16 02:54:44', NULL),
(190, 'PORTFOLIO000190', 17, 274, 'rumahbi2', '92X6](sCFe8tCz', 1, 'Rumah Bintaro Paradiso', NULL, '<p><span style=\"color: rgb(117, 117, 117); font-family: Raleway, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255); --darkreader-inline-color:#9e9689; --darkreader-inline-bgcolor:#181a1b;\" data-darkreader-inline-color=\"\" data-darkreader-inline-bgcolor=\"\">Hunian sempurna dengan gaya modern minimalis di jantung kawasan Bintaro. Bintaro Paradiso menawarkan kenyamanan, keamanan, dan lingkungan asri untuk Anda dan keluarga. Raihlah kemudahan hidup dengan hunian yang dikelilingi fasilitas pendidikan, pusat perbelanjaan, rumah sakit, dan pusat kuliner.</span><br style=\"color: rgb(117, 117, 117); font-family: Raleway, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255); --darkreader-inline-color:#9e9689; --darkreader-inline-bgcolor:#181a1b;\" data-darkreader-inline-color=\"\" data-darkreader-inline-bgcolor=\"\"><span style=\"color: rgb(117, 117, 117); font-family: Raleway, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255); --darkreader-inline-color:#9e9689; --darkreader-inline-bgcolor:#181a1b;\" data-darkreader-inline-color=\"\" data-darkreader-inline-bgcolor=\"\">Tinggal nyaman di daerah hunian paling strategis di Jakarta Selatan, bisa banget! Bintaro dari dulu memang sudah terkenal sebagai salah satu daerah hunian elit dan nyaman buat sebagian masyarakat Jakarta Selatan dan Tangerang Selatan. Akses yang mudah menuju pusat kota dan lengkap dengan berbagai destinasi hiburan, restoran dan kafe, membuat Bintaro jadi daerah yang sangat strategis.</span><br></p>', '//www.rumahbintaroparadiso.com', 2300000, 'logo-rumah-bintaro-paradiso.webp', 'rumah-bintaro-paradiso-1.webp', 'rumah-bintaro-paradiso-2.webp', 'rumah-bintaro-paradiso-3.webp', 'rumah-bintaro-paradiso-4.webp', 'rumah-bintaro-paradiso-5.webp', NULL, NULL, '2022-09-29', '2021-09-22 16:23:13', NULL, 1, 'rumah-bintaro-paradiso', 1, NULL, NULL, NULL, '2021-09-23 00:56:33'