(196, 'PORTFOLIO000196', 2, 408, 'subzerop', 'BP29n;iy.1cV6L', 1, 'Sub Zero', NULL, '<p>Subzero Pre Insulated Sandwich Panel are made using state of the art automated machinery from Italy. Using only the best of the best components such as our steel skin coated with the latest technologies to comply with all the building standard requirements. Most importantly, our PIR (Polyisocyanurate) Core with Optimum Helix® formulation resulting in best fire retardant properties and low thermal conductivity specification. Optimum Helix® enables us to stay true to our commitment as part of UNIDO. Producing pre insulated panels that is zero ODP and GWP to help save the earth. That’s why Subzero is always Redefining Conventional.<br></p>', '//www.subzeropanel.com', 0, 'logo-sub-zero.webp', 'sub-zero-1.webp', 'sub-zero-2.webp', 'sub-zero-3.webp', 'sub-zero-4.webp', 'sub-zero-5.webp', NULL, NULL, '2023-01-14', '2021-08-12 11:38:54', NULL, 1, 'sub-zero', 1, NULL, NULL, NULL, '2022-01-15 05:47:43', '2022-01-16 03:08:37', NULL),
