(198, 'PORTFOLIO000198', 2, 422, 'jualapa2', 'JeCom-37:1OH6u', 1, 'Jual Apartment Mewah', NULL, '<div>Berlandaskan akan banyaknya orang yang sulit mencari pilihan hunian masa depan yang cocok terhadap kebutuhan dan karakter para pembeli, JualApartmentMewah.com dibuat untuk membantu pada pembeli tersebut.</div><div><br></div><div>Dengan pengalaman lebih dari 10 tahun dan lebih dari 100 hunian mewah yang sudah dijual, kami berkomitmen untuk mengarahkan dan memberikan pilihan hunian yang cocok kepada Anda.</div><div><br></div><div>Begitu banyak hunian mewah yang kami dapat berikan dari rumah mewah sampai apartement mewah. St Regis Residence Jakarta, Le Parc The Terraces, Raffles Residence, Pakubuwono Signature, Langham Regent dan apartement mewah lainnya yang akan kami tawarkan. Jadi, jangan ragu untuk konsultasi kepada kami secara free.</div><div><br></div><div>Salam Jual Apartment Mewah.com</div>', '//www.jualapartmentmewah.com', 2250000, 'logo-jual-apartment-mewah.webp', 'jual-apartment-mewah-1.webp', 'jual-apartment-mewah-2.webp', 'jual-apartment-mewah-3.webp', 'jual-apartment-mewah-4.webp', 'jual-apartment-mewah-5.webp', NULL, NULL, '2023-03-24', '2022-03-08 11:56:07', NULL, 1, 'jual-apartment-mewah', 1, NULL, NULL, NULL, '2022-03-10 21:06:50', '2022-04-06 07:30:13', NULL),
(199, 'PORTFOLIO000199', 2, 422, 'luxuryap', 'd(oy9)sKQX773A', 1, 'Luxury Apartment Jakarta', NULL, '<p>Luxury Apartment Jakarta<br></p>', '//www.luxuryapartmentjakarta.com', 2250000, 'logo-luxury-apartment-jakarta.webp', 'luxury-apartment-jakarta-1.webp', 'luxury-apartment-jakarta-2.webp', 'luxury-apartment-jakarta-3.webp', 'luxury-apartment-jakarta-4.webp', 'luxury-apartment-jakarta-5.webp', NULL, NULL, '2023-03-24', '2022-03-08 11:56:07', NULL, 1, 'luxury-apartment-jakarta', 1, NULL, NULL, NULL, '2022-03-10 21:07:38', '2022-04-13 06:43:39', NULL),
(200, 'PORTFOLIO000200', 12, 285, 'u9758543', 'Hits2022', 1, 'HITS', NULL, '<div>Sekolah Tinggi Teologi Internasional Harvest (STTIH) atau disebut juga Harvest International Theological Seminary merupakan bentuk Sekolah Tinggi yang mengemban tugas dan fungsi perguruan tinggi dalam upaya mencerdaskan kehidupan bangsa, khususnya dalam pendidikan Teologi yang mengacu pada Undang-Undang Nomor 2 Tahun 1989 dan Peraturan Pemerintah No. 30 Tahun 1990 tentang penyelenggaraan pendidikan tinggi teologi.</div><div><br></div><div>HITS didirikan pada tanggal 05 Oktober 1998 oleh Dr. Jimmy Oentoro, merupakan sekolah tinggi teologi yang berada dalam pembinaan dan pengolaan Yayasan Tuaian Dunia serta akademis oleh Dirjen Bimas (Kristen) Protestan, Departemen Agama Republik Indonesia, dan diasuh oleh International Full Gospel Fellowsip (IFGF).</div><div><br></div><div>HITS mempunyai komitmen untuk mempersiapkan pemimpin-pemimpin yang unggul, terampil dan berdedikasi tinggi untuk memenuhi tantangan-tantangan masyarakat abad 21. Oleh sebab itu, HITS mengutamakan pengembangan karakter, kedisiplinan, dan kehidupan doa dan kasih para mahasiswanya sehingga menjadi gaya hidup dan dasar kepemimpinan. HITS menawarkan Program Studi Sarjana Teologi, Program Studi Pendidikan Agama Kristen, Program Studi Musik Gerejawi, serta Program Studi Pasca Sarjana dan Doctoral di bidang kepemimpinan dan transformasi. Setiap program studi telah terakreditasi oleh BAN PT.</div>', '//www.hits.ac.id', 4000000, 'logo-hits.webp', 'hits-1.webp', 'hits-2.webp', 'hits-3.webp', 'hits-4.webp', 'hits-5.webp', NULL, NULL, '2023-02-27', '2022-04-04 01:20:49', NULL, 1, 'hits', 1, NULL, NULL, NULL, '2022-04-03 11:21:44', '2022-04-06 07:20:12', NULL),
(201, 'PORTFOLIO000201', 12, 285, 'u3726482', 'Hits2022', 1, 'STMIK Harvest', NULL, 'STMIK Harvest adalah sebuah perguruan tinggi komputer yang didirikan oleh Yayasan STMIK Harvest, salah satu yayasan milik World Harvest, sebuah organisasi nirlaba internasional yang berkomitmen untuk memberi dampak pada dunia melalui pengembangan komunitas, pendidikan dan media.', '//www.stmikku.ac.id', 4000000, 'logo-stmik-harvest.webp', 'stmik-harvest-1.webp', 'stmik-harvest-2.webp', 'stmik-harvest-3.webp', 'stmik-harvest-4.webp', 'stmik-harvest-5.webp', NULL, NULL, '2023-05-13', '2022-05-13 00:02:03', NULL, 1, 'stmik-harvest', 1, NULL, NULL, NULL, '2022-05-12 10:03:19', '2022-06-26 11:45:49', NULL),
(202, 'PORTFOLIO000202', 10, 84, 'luttekid', 'L8m)T0KHz:z2x0', 1, 'Lutte Kids', NULL, 'Lutte Kids', '//www.luttekids.com', 3000000, 'logo-lutte-kids.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-05-27', '2022-05-22 21:50:00', NULL, 1, 'lutte-kids', 1, NULL, NULL, NULL, '2022-05-27 09:51:22', '2022-10-04 02:29:01', NULL),
(203, 'PORTFOLIO000203', 1, 427, NULL, NULL, 1, 'Astuti Bali Rental', NULL, '<p><span style=\"font-size: 13.2px;\">Astuti Bali Rental adalah jasa pelayanan transportasi darat profesional dan terpercaya. Armada Nyaman, Bisa sama Driver atau Lepas kunci. We are here to be the best choice in your transportation solution.</span></p><p><span style=\"font-family: Poppins, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif;\">We have friendly drivers who are very skilled in their fields, Make you always feel comfortable Sorong Car Rental Also set very friendly prices. All of that is nothing but so that you are satisfied with our services.</span><br></p>', NULL, 5000000, 'logo-astuti-bali-rental.jpg', 'astuti-bali-rental-1.webp', 'astuti-bali-rental-2.webp', 'astuti-bali-rental-3.webp', 'astuti-bali-rental-4.webp', 'astuti-bali-rental-5.webp', NULL, NULL, '2022-08-19', '2022-08-19 23:16:56', NULL, 0, 'astuti-bali-rental', 1, NULL, NULL, NULL, '2022-08-19 09:17:35', '2022-10-23 09:58:31', NULL),
