(205, 'PORTFOLIO000205', 1, 426, NULL, NULL, 1, 'Zealancare', NULL, 'Zealancare is a company that provides packages from New Zealand that are of original and good quality so that customers can have them cheaply and arrive quickly. We started pioneering since January 2022 where we are very enthusiastic to send the best products from New Zealand to you with attractive packages and quickly reach your hands. Our vision and mission is to deliver the original and best new zealand products.', NULL, 3000000, 'logo-zealancare.jpg', 'zealancare-1.webp', 'zealancare-2.webp', 'zealancare-3.webp', 'zealancare-4.webp', 'zealancare-5.webp', NULL, NULL, '2022-09-23', '2022-09-22 23:51:14', NULL, 1, 'zealancare', 1, NULL, NULL, NULL, '2022-09-22 21:49:05', '2022-10-03 20:33:00', NULL);
