(3, 'Online Store + CMS ± 8 Weeks', 'Toko Online + CMS ± 8 Minggu', 'A web that displays shop or company information and only displays a lot of products for sale', 'Web yang menampilkan informasi toko atau perusahaan dan hanya menampilkan banyak produk-produk yang dijual', 'Rp. 5.000.000 Free Domain and Hosting', 'Rp. 5.000.000 Gratis Domain dan Hosting', 1, NULL, NULL, NULL, '2020-11-17 09:20:18', '2020-11-17 09:20:18', NULL),
