(6, 'Extend Domain and Hosting', 'Perpanjang Domain dan Hosting', 'After the 2nd year the website is created, an extension fee will be charged so that the website does not expire', 'Setelah tahun ke 2 website dibuat, maka akan dikenakan biaya perpanjang agar tidak expired websitenya', 'Rp. 1.000.000 / years', 'Rp. 1.000.000 / tahun', 1, NULL, NULL, NULL, '2020-11-17 09:20:18', '2020-11-17 09:20:18', NULL);
INSERT INTO `procedures` (`id`, `code`, `procedure_category_id`, `name`, `description`, `is_active`, `created_by_id`, `updated_by_id`, `deleted_by_id`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'PROCEDURE000001', 1, 'Contact Us Opening', 'Selamat \"Pagi/Siang/Sore/Malam\" \"Bapak/Ibu/Gan/Sis\" \"Nama\", terima kasih sudah mengunjungi website www.diw.co.id dan menghubungi kami.\n\n\"Jika hanya sapaan (Halo Gan)\"\nAda yang bisa kami bantu?\n\n\"Ingin buat website (Saya ingin buat website)\"\nMau buat website seperti apa? Bisa dijelaskan konsep dan data beserta contoh yang di inginkan?\n\n\"Menanyakan bisa buat website (Bisa buat website)\"\nBisa gan. Mau bikin website seperti apa? Bisa dijelaskan konsep dan data beserta contoh yang di inginkan?\n\n\"Jika, bertanya (Saya ingin menanyakan tentang website)\"\nOh boleh, mau tanya apa?\n\n\"Harga Website\"\nUntuk biaya investasi website, tergantung dari konsep dan permintaan yang diminta.\n[ENTER]\nKami wajib mengetahui konsep dan permintaan yang di inginkan, bisa dikirimkan ke email project@diw.co.id\n[ENTER]\nApakah ada contoh website yang bisa kami lihat untuk mengetahui permintaan \"Bapak/Ibu/Gan\" \"Nama\"?\n\n\"Harga to the point (Saya ingin tahu harga berapa dan mulai dari berapa)\"\nHarga di DIW.co.id tergantung konsep dan permintaan yang diberikan, supaya kami mengetahui batasan-batasan yang diminta\n[ENTER]\nUntuk harga kita start dari Rp. 3.000.000 (Website Standart)\n[ENTER]\nHasil karya kami ada di diw.co.id/all-portfolio\n\n\"Selesai, Dipikirkan dulu, terima kasih\"\nOke baik \"Bapak/Ibu/Gan/Sis\" \"Nama\". Jika ada yang kurang jelas, bisa hubungi kami kembali.\n[ENTER]\nLine : @diw.co.id\nWhatsapp : 087871113361\nWebsite : www.diw.co.id\n[ENTER]\nTerima kasih atas waktunya. Selamat \"Pagi/Siang/Sore/Malam\"', 1, NULL, NULL, NULL, '2017-11-27 20:06:00', '2019-07-27 14:29:58', NULL),
(2, 'PROCEDURE000002', 3, 'Email File Download', 'File website yang telah dikirimkan ke email mohon di download dan dibuat backup\'an nya karena akan dihapus dari email dan google drive setelah 1 minggu dari terkirimnya email tersebut. Terima kasih', 1, NULL, NULL, NULL, '2017-11-27 20:06:00', '2019-07-27 14:29:58', NULL),
(3, 'PROCEDURE000003', 4, 'DIW.co.id System Endorsement', 'DIW.co.id System Endorsement\nDibuat 06 Desember 2017\n\nPROSEDUR\n1. DIW.co.id akan transfer pembayaran\n2. Influencer wajib memberikan data/foto/video asli ke email info@diw.co.id sebagai arsip.\n3. Influencer memposting sesuai caption dari Influencer atau DIW.co.id.\n4. Postingan wajib tag ke diw.co.id.\n5. Di comment postingan, wajib tambah hastag yang akan diberikan.\n\nCAPTION\n1. Mohon gunakan spasi & enter agar mudah dibaca.\n2. Caption pembuka boleh bebas, dibawahnya wajib ditambahkan.\n\nYuk langsung hubungi developernya\nWhatsapp : 087871113361\nLine : diw.co.id\nWebsite : www.diw.co.id\n\nSudah 90++ website yang dikerjakan DIW.co.id lohhhh\nMelayani Pembuatan Program Skripsi Web Based\n\nTAMBAHAN HASTAG DI CAPTION / COMMENT\n#diw #diw_co_id #developinspirewebsite #web #website #aplikasi #application #program #photography #photo #endorsement #influencer #marketing #marketingdigital #beauty #instagram #startup #companyprofile #ecommerce #online #trending #webdesign #design  #programming #skripsi #thesis #promosi #promotion #life #lifestyle\n\nCATATAN\n1. Mohon berikan yang foto/postingan yang terbaik karena akan diposting lagi di IG @diw.co.id @andrisunardi dan website www.diw.co.id\n2. Caption boleh bebas dari Influencer atau dapat diperbaharui yang telah dikasih oleh DIW.co.id akan tetapi wajib ditambahkan dibawahnya\n3. Postingan tidak boleh di delete dengan alasan apapun.\n4. DIW.co.id akan following Influencer, mohon untuk di follow back.\n5. Mohon postingan endorsement tidak di timpa dengan postingan foto baru, jika bisa berikan waktu selama 1 sampai 2 hari untuk mereka melihat postingan endorsement.\n6. Jika ada yang menanyakan tentang DIW.co.id, bisa langsung beritahu kami, bisa tag @diw.co.id atau di comment langsung saja hubungi di 087871113361 website www.diw.co.id\n\nSANKSI\nJika influencer tidak menaati panduan dan aturan DIW.co.id, maka\n1. Blacklist, nama lengkap, username instagram, link instagram, bank, nama dan nomor rekening, foto, dan sebagainya lalu di publishkan di account IG DIW.co.id sebagai penipuan/pelanggaran.\n2. DIW.co.id berhak akan menegakan keadilan dan dapat di bawa ke proses jalur hukum.\n3. Jangan mencoba untuk melanggar aturan dan ketentuan DIW.co.id, karena kami banyak cara untuk mendapatkan data anda.\n\nTerima kasih sudah membantu startup kami.\nSukses selalu GBU\n\nAndri Sunardi - Founder & CEO DIW.co.id', 1, NULL, NULL, NULL, '2017-12-01 05:07:14', '2019-07-27 14:29:58', NULL),
(4, 'PROCEDURE000004', 2, 'Remove Created by DIW.co.id', 'Dengan anda memilih penghapusan kata \"Created by DIW.co.id\" maka kami tidak dapat mempromosikan website anda di sosial media maupun di website www.diw.co.id\n\nAnda dapat memilih menghilangkan kata \"Created by DIW.co.id\" di website www.diw.co.id pada menu Dashboard > My Website', 1, NULL, NULL, NULL, '2017-12-03 05:07:14', '2019-07-27 14:29:58', NULL),
(5, 'PROCEDURE000005', 5, 'Absent Part Time', 'Dengan anda menjadi staff part time di DIW.co.id, maka aturan absent sebagai berikut:\n1. Toleransi keterlambatan adalah 15menit, lebih dari 15menit maka terhitung jam berikutnya (Diusahakan datang lebih pagian sebelum jamnya)\n2. Pemakaian hari libur maksimal 3 hari', 1, NULL, NULL, NULL, '2017-12-03 05:07:14', '2019-07-27 14:29:58', NULL),
(6, 'PROCEDURE000006', 1, 'Follow Up Client', 'Selamat \"Pagi/Siang/Sore/Malam\" \"Bapak/Ibu/Gan\" \"Nama\", Kami ingin memfollow up project yang sebelumnya telah kita diskusikan, bagaimana dengan project website yang akan dibuat?\n\n\"Masih progress buat data dan konsepnya\"\nOke baik \"Bapak/Ibu/Gan\" \"Nama\", mohon maaf apabila follow up kami menganggu aktivitas anda.\n[ENTER]\nTerima kasih atas informasinya, Selamat \"Pagi/Siang/Sore/Malam\"\n\n\"Maaf kami tidak jadi buat, sudah sama yang lain\"\nOke baik \"Bapak/Ibu/Gan\" \"Nama\", mohon maaf apabila follow up kami menganggu aktivitas anda.\n[ENTER]\nTerima kasih sudah minat dan menghubungi DIW.co.id.\n[ENTER]\nJika ada project website dan butuh pembuatan website, bisa hubungi kami di\nLine : @diw.co.id\nWhatsapp : 087871113361\nWebsite : www.diw.co.id\n\nCATATAN\nFollow up dilakukan setelah 2 hari, contoh Senin, bearti hari Kamis baru chat lagi', 1, NULL, NULL, NULL, '2017-12-05 08:42:00', '2019-07-27 14:29:58', NULL),
(7, 'PROCEDURE000007', 5, 'Ask Developer Phone Number', 'Maaf, \"Bapak/Ibu/Gan\" \"Nama\", kami tidak dapat memberikan nomor developer/staff.', 1, NULL, NULL, NULL, '2017-12-07 05:07:14', '2019-07-27 14:29:58', NULL),
