(9, 'PROCEDURE000009', 4, 'Interest Endorsement', 'Selamat \"Pagi/Siang/Sore/Malam\" \"Bapak/Ibu/Gan/Sis\" \"Nama\", terima kasih sudah mengunjungi website www.diw.co.id dan menghubungi kami.\n\n\"Tertarik\"\nBoleh  \"Bapak/Ibu/Gan/Sis\" \"Nama\"\n[ENTER]\nBoleh sebutkan username IG \"Bapak/Ibu/Gan/Sis\" \"Nama\", biar kami review Profile IG \"Bapak/Ibu/Gan/Sis\" \"Nama\" terlebih dahulu.\n[ENTER]\nSebelumnya, agan bisa baca syarat endorsement di diw.co.id/endorsement\n[ENTER]\nSyarat Influencer\n1. Public Account (Tidak Private)\n2. Minimal Follower 5.000\n3. Minimal Total Post 100\n4. Minimal Likes 1 Post 500\n5. Minimal Comment 1 Post 10\n6. Keaktifan Bermain Instagram\n7. Wajib Follow Account @DIW.co.id\nSemua syarat di atas dapat di pertimbangkan oleh pihak management DIW.co.id\n[ENTER]\nDengan anda daftar influencer, bearti anda mematuhi peraturan dari kami dan siap menjalani hukum jika terdapat sanksi\n[ENTER]\nJika \"Bapak/Ibu/Gan/Sis\" \"Nama\" diterima, maka kami akan membalas pesan \"Bapak/Ibu/Gan/Sis\" \"Nama\" ini\n[ENTER]\nJika tidak, maka  \"Bapak/Ibu/Gan/Sis\" \"Nama\" tidak perlu membalas pesan ini lagi.\n[ENTER]\nKami ucapkan terima kasih sudah mendaftar endorsement DIW.co.id', 1, NULL, NULL, NULL, '2017-12-01 05:07:14', '2019-07-27 14:29:58', NULL),
(10, 'PROCEDURE000010', 2, 'Extend Domain Hosting', 'Selamat \"Pagi/Siang/Sore/Malam\" \"Bapak/Ibu/Gan/Sis\" \"Nama\"\n[ENTER]\nKami dari DIW.co.id menginformasikan bahwa domain dan hostingan \"Nama Website - URL Domain\" akan berakhir pada tanggal \"Tanggal Jatuh Tempo\"\n[ENTER]\nBiaya Perpanjangan sebesar Rp. 600.000\nTransfer ke Bank BCA 8820460929 Andri Sunardi\nDan informasikan bukti transfer ke whatsapp 087871113361 atau email payment@diw.co.id\nBatas pembayaran paling lambat tanggal \"Tanggal Jatuh Tempo\"\n[ENTER]\nTerima kasih atas perhatiannya.\n[ENTER]\n* Abaikan pesan ini jika tidak ingin di perpanjang.', 1, NULL, NULL, NULL, '2017-12-18 21:58:00', '2019-07-27 14:29:58', NULL),
