(16, 'PROCEDURE00016', 6, 'Student Rules', 'Dengan anda membeli jasa DIW.co.id, maka anda harus menaati peraturan dibawah ini.\\r\\nKhusus Mahasiswa\\r\\n\\r\\n1. Dimohonkan agar anda menggunakan, mencoba, dan memeriksa program (website) yang sudah dibuat dan dikirimkan secara detail dan lengkap. Jika terjadi kesalahan ataupun error, kami dapat memperbaikinya. Karena kami testing juga tidak luput dari human error, tidak menjamin 100% benar tanpa di testing.\\r\\n\\r\\n2. Perbaikan program tidak dapat dilakukan cepat, hal ini karena DIW System menunggu antrian project-project lainnya dan analisis revisi yang anda berikan. Untuk itu, dimohonkan anda memberikan revisi jauh hari sebelum deadline.\\r\\n\\r\\n3. DIW System tidak menyimpan data lama ataupun revisi yang lama, jadi jika anda ingin revisi, dipikirkan 2 kali, karena program akan tertimpa dengan code dan revisi yang baru.\\r\\n\\r\\n4. Kami tidak akan merevisi hal yang sebelumnya sudah dikerjakan. Contohnya, revisi angka 1 menjadi angka 2, dan balik lagi ke angka 1.\\r\\n\\r\\n5. Kami tidak bertanggung jawab atas terjadinya aturan dari kampus, sidang, ataupun dosen. Kami hanya membuat program untuk mahasiswa.\\r\\n\\r\\n6. Segala aturan dan syarat ketentuan yang umum berlaku di mahasiswa. Mahasiswa tunduk atas aturan ini.\\r\\n\\r\\nTerakhir diperbaharui 13 Januari 2018', 1, NULL, NULL, NULL, '2018-01-11 13:40:00', '2019-07-27 14:29:59', NULL),
