INSERT INTO `quotes` (`id`, `code`, `name`, `owner`, `is_active`, `created_by_id`, `updated_by_id`, `deleted_by_id`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'QUOTE00001', 'Karena penolakan seperti lemparan dadu\r\nTapi kalau kita tidak melempar pertanyaan, maka kita tidak akan tahu, sama sekali tidak tahu.', 'Bong Chandra', 1, NULL, NULL, NULL, '2017-07-31 06:00:00', '2019-07-27 14:34:52', NULL),
(2, 'QUOTE00002', 'Success is not an object, IT IS A SUBJECT.', 'Bong Chandra', 1, NULL, NULL, NULL, '2017-07-31 06:00:00', '2019-07-27 14:34:52', NULL),
(3, 'QUOTE00003', 'If you dont RISK your life, you can\'t CREATE a future.', 'Monkey D. Luffy', 1, NULL, NULL, NULL, '2017-07-31 06:00:00', '2019-07-27 14:35:22', NULL),
(4, 'QUOTE00004', 'Kamu tak akan pernah terlihat buruk bagi orang yang mencintaimu bahkan ketika kamu dalam keadaan berantakan sekalipun', 'Unknown', 1, NULL, NULL, NULL, '2021-02-01 21:10:05', '2021-02-01 21:11:41', NULL),
(5, 'QUOTE00005', 'Gak peduli orang lain butuh kita atau gak, yang penting kita selalu ada untuk mereka', 'Raditya Dika', 1, NULL, NULL, NULL, '2021-02-01 21:11:56', '2021-02-01 21:11:56', NULL),
(6, 'QUOTE00006', 'Marah itu butuh tenaga dan membuatku lelah. Jadi aku lebih memilih meminta maaf meski bukan aku yang salah', 'Tanaka', 1, NULL, NULL, NULL, '2021-02-01 21:12:07', '2021-02-01 21:12:07', NULL),
(7, 'QUOTE00007', 'Belum pernah ada berita bahwa orang yang memberi pada akhirnya menjadi miskin. Belum Pernah', 'Unknown', 1, NULL, NULL, NULL, '2021-02-01 21:12:18', '2021-02-01 21:12:18', NULL),
(8, 'QUOTE00008', 'Ketika KENYATAAN tidak sesuai dengan IMPIANMU, berpikirlah, cari dan temukan penyebabnya, dan jangan pernah berhenti menggejar impianmu.', 'Unknown', 1, NULL, NULL, NULL, '2021-02-01 21:12:30', '2021-02-01 21:12:30', NULL),
(9, 'QUOTE00009', 'Orang gagal biasanya takut mencoba. Baginya lebih baik berdiam diri daripada mencoba dan gagal', 'Unknown', 1, NULL, NULL, NULL, '2021-02-01 21:12:39', '2021-02-01 21:12:39', NULL),
(10, 'QUOTE00010', 'Tetaplah berbuah baik walaupun merasa tidak dihargai. Ada masanya semua itu akan terbalaskan', 'Unknown', 1, NULL, NULL, NULL, '2021-02-01 21:12:49', '2021-02-01 21:12:49', NULL),
(11, 'QUOTE00011', 'Kau tau sesuatu yang lebih menyakitkan dari sebuah pukulan. Yaitu perkataan', 'Unknown', 1, NULL, NULL, NULL, '2021-02-01 21:13:03', '2021-02-01 21:13:03', NULL),
(12, 'QUOTE00012', 'Sebuah pertanyaan. Aku bertanya pada seorang sahabat \"Bagaimana solusimu ketika aku terlalu lelah untuk bertahan tetapi terlalu cinta untuk melepaskan? Dia menjawaab, \"cinta adalah kuatmu dalam bertahan, tetapi lepaskanlah jika kuatmu tidak dihargai\"', 'Unknown', 1, NULL, NULL, NULL, '2021-02-01 21:13:30', '2021-02-01 21:13:30', NULL),
(13, 'QUOTE00013', 'Apapun yang menyedihkanmu hari ini, ingatlah bahwa engkau telah pernah melalui yang lebih buruk daripada itu. Engkau telah pernah diselamatkan karena kesabaranmu sebelum ini, maka bersabarlah lagi hari ini. Jangan putus harapan, jangan menyerah. Upayakan lagi dengan lebih baik.', 'Mario Teguh', 1, NULL, NULL, NULL, '2021-02-01 21:13:50', '2021-02-01 21:13:50', NULL),
(14, 'QUOTE00014', 'Saya pernah benar-benar tulus mencintai seseorang sampai akhirnya saya sadar bahwa acinta saya yang tulus telah di permainkan. Dan sekarang saya takut untuk mencintai seseorang.', 'Unknwon', 1, NULL, NULL, NULL, '2021-02-01 21:14:03', '2021-02-01 21:14:03', NULL),
(15, 'QUOTE00015', 'When I was a child. I was afraid of ghosts. As I grew up, I realized people are more scary.', 'Unknown', 1, NULL, NULL, NULL, '2021-02-01 21:15:30', '2021-02-01 21:15:30', NULL),
(16, 'QUOTE00016', 'Saya tidak anti rokok. Saya hanya tidak ingin menggunakan ilmu dari Tuhan untuk menguatkan penyebaran kebiasaan buruk.', 'Mario Teguh', 1, NULL, NULL, NULL, '2021-02-01 21:15:42', '2021-02-01 21:15:42', NULL),
(17, 'QUOTE00017', 'Sukses adalah alasan yang paling sering digunakan oleh orang yang iri untuk membenci dan memfitnah.', 'Mario Teguh', 1, NULL, NULL, NULL, '2021-02-01 21:16:24', '2021-02-01 21:16:24', NULL),
(18, 'QUOTE00018', 'Hormati Tuhan, kalau anda ingin dijadikan terhormat.', 'Mario Teguh', 1, NULL, NULL, NULL, '2021-02-01 21:16:38', '2021-02-01 21:16:38', NULL),
(19, 'QUOTE00019', 'Saat orang ngomongin DI BELAKANG, itu artinya, kita jauh DI DEPAN mereka. Saat orang MERENDAHKAN itu artinya, kita jauh LEBIH TINGGI dari mereka. Saat orang IRI dengan kita, itu artinya kita jauh LEBIH SUKSES. Saat orang bicara BURUK, itu artinya hidup kita jauh LEBIH INDAH dari mereka.', 'Unknown', 1, NULL, NULL, NULL, '2021-02-01 21:16:51', '2021-02-01 21:16:51', NULL),
(20, 'QUOTE00020', 'Lucu adalah, saat aku mulai menjauhimu, kau malah mendekatiku.', 'Unknown', 1, NULL, NULL, NULL, '2021-02-01 21:17:00', '2021-02-01 21:17:00', NULL),
