(25, 'QUOTE00025', 'Berjanjilah, kamu tidak akan pernah meninggalkan aku?', 'Unknown', 1, NULL, NULL, NULL, '2021-02-01 21:18:37', '2021-02-01 21:18:37', NULL),
(26, 'QUOTE00026', 'Dibalik cie ada kecemburuan, dibalik gapapa ada masalah, dibalik terserah ada keinginan, dibalik yaudah ada kekecewaan.', 'Unknown', 1, NULL, NULL, NULL, '2021-02-01 21:18:45', '2021-02-01 21:18:45', NULL),
(27, 'QUOTE00027', 'Jangan karna seseorang tulus sayang sama kamu terus kamu bisa seenak jidat kamu. Inget, dia bisa pergi kapan saja.', 'Unknown', 1, NULL, NULL, NULL, '2021-02-01 21:18:54', '2021-02-01 21:18:54', NULL),
(28, 'QUOTE00028', 'If you focus on results, you will never change. If you focus on change, you will get results.', 'Jack Dixon', 1, NULL, NULL, NULL, '2021-02-01 21:19:10', '2021-02-01 21:19:10', NULL),
(29, 'QUOTE00029', 'Jadilah seorang wanita yang dibutuhkan lelaki, bukan seorang wanita yang membutuhkan lelaki.', 'Unknown', 1, NULL, NULL, NULL, '2021-02-01 21:19:18', '2021-02-01 21:19:18', NULL),
(30, 'QUOTE00030', 'Kekhawatiran kita tidak akan dapat mengubah pergumulan yang sedang kita hadapi, oleh sebab itu berserahlah dan andalahkanlah Tuhan di dalam menjalani kehidupan ini.', 'Unknown', 1, NULL, NULL, NULL, '2021-02-01 21:19:26', '2021-02-01 21:19:26', NULL),
