(32, 'QUOTE00032', 'The best love is the one that makes you  a better person, without changing you into someone other than yourself.', 'Unknown', 1, NULL, NULL, NULL, '2021-02-01 21:19:43', '2021-02-01 21:19:43', NULL),
(33, 'QUOTE00033', 'No matter what people think of you, always keep smiling and walk away.', 'Unknown', 1, NULL, NULL, NULL, '2021-02-01 21:19:52', '2021-02-01 21:19:52', NULL),
(34, 'QUOTE00034', 'Sakit itu ketika kamu sudah bertahan pada satu pilihan, tetapi pilihan itu lebih memilih orang yang baru datang dalam hidupnya.', 'Unknown', 1, NULL, NULL, NULL, '2021-02-01 21:20:05', '2021-02-01 21:20:05', NULL),
(35, 'QUOTE00035', 'Kita dipertemukan karena sebuah alasan, alasan itu bernama cinta sampai kamu menghancurkannya tanpa alasan.', 'Unknown', 1, NULL, NULL, NULL, '2021-02-01 21:20:13', '2021-02-01 21:20:13', NULL),
(36, 'QUOTE00036', 'I don\'t know you, but if you still posting penunggi, pelangsing, dan jualan follower, i will find you and i will kill you.', 'Unknown', 1, NULL, NULL, NULL, '2021-02-01 21:20:21', '2021-02-01 21:20:21', NULL),
(37, 'QUOTE00037', 'Kuliah itu susah, tapi masih susah perjuangan orang tua nguliahin anaknya', 'Unknown', 1, NULL, NULL, NULL, '2021-02-01 21:20:30', '2021-02-01 21:20:30', NULL),
(38, 'QUOTE00038', 'Yang cantik itu memang menggoda. Tapi yang  cari duid sendiri itu idaman.', 'Unknown', 1, NULL, NULL, NULL, '2021-02-01 21:20:42', '2021-02-01 21:20:42', NULL),
(39, 'QUOTE00039', 'Kalau aku masih mau marah sama kamu bearti kamu masih penting. Tapi jika aku sudah diam, bearti kamu bukan apa-apa lagi.', 'Unknown', 1, NULL, NULL, NULL, '2021-02-01 21:20:51', '2021-02-01 21:20:51', NULL),
(40, 'QUOTE00040', 'Jangan mengubah dirimu hanya karena ingin dicintai. Jika dia tak bisa menerima kamu apa adanya, temukan seseorang yang bisa.', 'Unknown', 1, NULL, NULL, NULL, '2021-02-01 21:20:59', '2021-02-01 21:20:59', NULL),
