(47, 'QUOTE00047', 'Yang penting baik aja dulu sama orang, mau dibalesnya kaya gimana, itu urusan dia sama Tuhan.', 'Unknown', 1, NULL, NULL, NULL, '2021-02-01 21:22:08', '2021-02-01 21:22:08', NULL),
