(49, 'QUOTE00049', 'Hidup adalah sesuatu yang bergerak. Kekuatan Manusia bukan sesuatu yang statis. Tuhan menganugerahkan segala fitur pembangkit keberhasilan di dalam tubuh dan pikiran kita. Aku bersyukur karena kusadari itu sejak muda untuk meraih sukses. (Buku Mimpi Sejuta Dolar - Halaman 1)', 'Merry Riana', 1, NULL, NULL, NULL, '2021-02-02 19:43:46', '2021-02-02 19:43:46', NULL),
(50, 'QUOTE00050', 'GOD\'S PLAN is always the best. Sometimes the process is painful and hard. But don\'t forget that when GOD IS SILENT. He\'s doing something for you.', 'Unknown', 1, NULL, NULL, NULL, '2021-02-04 08:23:37', '2021-02-04 08:23:37', NULL),
(51, 'QUOTE00051', 'Jangan Pernah Mengukur Kuasa TUHAN Yang Tak Terbatas Dengan HARAPAN Anda Yang Terbatas.', 'Unknown', 1, NULL, NULL, NULL, '2021-02-06 19:44:17', '2021-02-06 19:44:17', NULL),
