(53, 'QUOTE00053', 'Awali pagimu dengan kasih sayang, iringi langkahmu dengan senyuman, dan penuhi hari-harimu dengan kebaikakn. Semangat Pagi', 'Unknown', 1, NULL, NULL, NULL, '2021-02-06 20:11:46', '2021-02-06 20:11:46', NULL),
