(56, 'QUOTE00056', 'Jadi, sudah berapa hati yng kau tolak dan kau sakiti demi menunggu seseorang yang belum pasti cinta sama kamu ?', 'Unknown', 1, NULL, NULL, NULL, '2021-02-06 20:34:34', '2021-02-06 20:34:34', NULL),
