(97, 'QUOTE00097', 'Jika ingin berjalan cepat, maka jalanlah sendiri. Jika ingin berjalan jauh, maka jalanlah bersama-sama.', 'Menkumham', 1, NULL, NULL, NULL, '2021-03-22 10:35:53', '2021-03-22 10:35:53', NULL),
(98, 'QUOTE00098', 'Bekerja sendiri bikin kita melangkah lebih cepat, akan tetapi bekerja bersama bikin kita melangkah lebih jauh.', 'Unknown', 1, NULL, NULL, NULL, '2021-03-22 10:36:52', '2021-10-06 09:13:23', NULL),
(99, 'QUOTE00099', 'Yang baik belum tentu datang dari Tuhan. Tapi dari Tuhan pasti baik', 'Pdt. GIDEON SIMANJUNTAK, S.H., M.Th.', 1, NULL, NULL, NULL, '2021-03-23 01:12:58', '2021-03-23 01:12:58', NULL),
(100, 'QUOTE00100', 'Tidak semua orang dipanggil menjadi PENDETA. Tapi semua orang dipanggil menjadi PELITA', 'Pdt. Gideoon Simmanjuntak, S.H., M.Th.', 1, NULL, NULL, NULL, '2021-04-04 12:56:37', '2021-04-04 12:56:37', NULL),
(101, 'QUOTE00101', 'Nikah itu bukan jawaban. Kalau dasarnya bukan cinta. Pernikahan menggabungkan 2 masalah menjadi satu dan menyelesaikan dengan bersama.', 'Ps. Petra Fanggidae', 1, NULL, NULL, NULL, '2021-04-11 09:40:15', '2021-04-11 09:40:15', NULL),
(102, 'QUOTE00102', 'Tuhan itu tidak bisa di suap. Berkat kita juga datang dari Tuhan. Masakan dengan berkat yang Tuhan sudah berikan kita suap kepada Tuhan ?', 'Unknown', 1, NULL, NULL, NULL, '2021-04-13 09:55:00', '2021-04-13 09:55:00', NULL),
(103, 'QUOTE00103', 'Kesempatan datangnya dari Tuhan tetapi Kesiapan adalah bagian kita.', 'Unknown', 1, NULL, NULL, NULL, '2021-04-17 05:01:06', '2021-04-17 05:01:06', NULL),
(104, 'QUOTE00104', 'Wanita tidak pandai mencari topik pembicaraan, tapi mereka pandai mencari topik permasalahan.', 'Unknown', 1, NULL, NULL, NULL, '2021-05-30 12:34:38', '2021-05-30 12:34:38', NULL),
(105, 'QUOTE00105', 'Tidak usah mencari yang terbaik. Tapi carilah yang bisa menerimamu dengan baik.', 'Unknown', 1, NULL, NULL, NULL, '2021-06-14 12:20:03', '2021-06-14 12:20:03', NULL),
(106, 'QUOTE00106', 'Semua masalah itu harus dihadapi bukan dilupakan', 'Unknown', 1, NULL, NULL, NULL, '2021-07-06 12:51:54', '2021-07-06 12:51:54', NULL),
(107, 'QUOTE00107', 'ALONE i can \"SAY\", but TOGETHER we can \"TALK\". ALONE i can \"ENJOY\", but TOGETHER we can \"CELEBRATE\". ALONE i can \"SMILE\", but TOGETHER we can \"LAUGH\"', 'Ps. Sam Hartanto', 1, NULL, NULL, NULL, '2021-07-07 04:22:59', '2021-07-07 04:22:59', NULL),
(108, 'QUOTE00108', 'MEZBAH adalah apa yang kita bangun. BERHALA adalah apa yang kita sembah.', 'Ps. Mark Mcclendon', 1, NULL, NULL, NULL, '2021-07-16 01:41:00', '2021-07-16 01:41:00', NULL),
(109, 'QUOTE00109', 'Orang akan mengerti jika mereka berada di posisi yang sama.', 'Unknown', 1, NULL, NULL, NULL, '2021-08-28 06:59:28', '2021-08-28 06:59:28', NULL),
(110, 'QUOTE00110', 'Memang disitulah bedanya. Kalau disekolah, dapet pelajaran dulu baru kau diuji. Kalau di kehidupan, dapat jian dulu baru dapat pelajaran.', 'Pidi Baiq', 1, NULL, NULL, NULL, '2021-08-28 07:50:50', '2021-08-28 07:50:50', NULL),
(111, 'QUOTE00111', 'Jangan pernah menjadi pelangi untuk orang yang buta warna', 'Unknown', 1, NULL, NULL, NULL, '2021-08-28 08:16:19', '2021-08-28 08:16:19', NULL),
(112, 'QUOTE00112', 'Jika kita punya 99 kebaikan dan 1 kesalahan, maka manusia lebih akan ingat dengan 1 kesalahan daripada 99 kebaikan. Seberusaha apapun kita memperbaiki penampilan dihadapan manusia, tetap akan ada kekurangan dan cacat yang dinilai. Jadi intinya jangan bersusah payah memperbaiki diri agar dipandang baik oleh manusia, penilaian mereka tidak akan mempengaruhi siapa kita dihadapan Tuhan, Tuhan yang lebih pantas menilai diri kita, penilaian Tuhan yang akan mempengaruhi kehidupan akhir kita, jika Tuhan menilai baik, selamatlah kita untuk ke surga-Nya, jika Tuhan menilai buruk, rugilah kita karena akan dicampakkan ke neraka.', 'Unknown', 1, NULL, NULL, NULL, '2021-08-28 08:18:54', '2021-08-28 08:18:54', NULL),
(113, 'QUOTE00113', 'Orang Kristen harus mengalami perjumpaan dengan Kitab Suci, tidak hanya melafalkan ayat Kitab Suci seperti burung beo.', 'Paus Fransiskus', 1, NULL, NULL, NULL, '2021-09-04 19:22:19', '2021-09-04 19:22:19', NULL),
(114, 'QUOTE00114', 'Jangan resign dari pekerjaanmu untuk membangun bisnis. Sebaliknya, bangun bisnis untuk resign dari pekerjaanmu.', 'Unknown', 1, NULL, NULL, NULL, '2021-09-04 19:35:09', '2021-09-04 19:35:09', NULL),
(115, 'QUOTE00115', 'Wanita hampir tidak mau BERHENTI BICARA saat sedang BAHAGIA, dan memutuskan untuk DIAM seribu bahasa saat sedang KECEWA.', 'Unknown', 1, NULL, NULL, NULL, '2021-09-04 19:36:10', '2021-09-04 19:36:10', NULL),
(116, 'QUOTE00116', 'Kamu bisa mengalahkan 30 orang pintar dengan 1 fakta. Tapi kamu enggak bisa mengalahkan 1 orang bodoh dengan 30 fakta.', 'BJ Habibie', 1, NULL, NULL, NULL, '2021-09-04 19:37:13', '2021-09-04 19:37:13', NULL),
(117, 'QUOTE00117', 'Ketika ada yang melempari mu batu, jangan lempari mereka balik, tapi koleksi batunya lalu babngun kerajaan sendiri.', 'Unknown', 1, NULL, NULL, NULL, '2021-09-04 19:38:20', '2021-09-04 19:38:20', NULL),
(118, 'QUOTE00118', 'Hello people, i just would like to said that, some pastors are having side jobs too, and perharps they “earn” these things from their side jobs. Like if you guys do a stalking towards Pastor Phillip youtube’s channel...he’s also a painter! and had he’s own painting showcase! Dont be so bitter, and i think thats normal to have a few “branded stuff” even thou they’re a pastors...peace out people, dont be so bitter and negative ok!', 'Unknown', 1, NULL, NULL, NULL, '2021-09-17 07:47:30', '2021-09-17 07:47:30', NULL),
(119, 'QUOTE00119', 'Teach your daughter economic independence so in the future, she can have a partner, not a master. Teach your son to do housework so in the future, he  can have a partner,  not a servant.', 'Unknown', 1, NULL, NULL, NULL, '2021-10-21 12:18:57', '2021-10-21 12:18:57', NULL),
(120, 'QUOTE00120', 'Jika anda bukan berasal dari keluarga yang kaya, maka keluarga yang kaya harus berawal dari anda.', 'Unknown', 1, NULL, NULL, NULL, '2021-10-21 12:20:22', '2021-10-21 12:20:22', NULL),
(121, 'QUOTE00121', 'Aku minta yang baik, Tuhan kasih yang terbaik', 'Unknown', 1, NULL, NULL, NULL, '2021-10-25 09:36:44', '2021-10-25 09:36:44', NULL),
(122, 'QUOTE00122', 'Even when you think everyone doesn\'t care about you, there will always be someone who cares.', 'Unknown', 1, NULL, NULL, NULL, '2021-10-25 09:57:47', '2021-10-25 09:57:47', NULL),
(123, 'QUOTE00123', 'Jika keselamatan diterima dengan cuma-cuma, tidak demikian dengan upah.', 'Unknown', 1, NULL, NULL, NULL, '2021-11-03 08:22:51', '2021-11-03 08:22:51', NULL),
(124, 'QUOTE00124', 'If you lose your money, you can get it back. But if you lose your time, you can\'t get it back.', 'Unknown', 1, NULL, NULL, NULL, '2021-11-05 09:07:21', '2021-11-05 09:07:21', NULL),
(125, 'QUOTE00125', 'Aku percayaa bahwa diriku hari ini tercipta karena aku memiliki masa lalu. Dan aku percaya, bahwa tanpa Tuhan, aku tidak dapat melalui masa laluku hingga aku menjadi diriku yang sekarang :) Tuhan bersama-Mu aku merasa aman', 'Army of God', 1, NULL, NULL, NULL, '2021-12-14 08:09:34', '2021-12-14 08:10:57', NULL);
